INSERT INTO `tbl_page_content` (`id`, `page_id`, `lang_id`, `subject`, `synopsis`, `text`) VALUES
(1, 1, 1, 'About Us', 'PT OFFISTARINDO ADHIPRIMA established since 1990, and with determination and ceaseless hard work of all staff and Board of Directors of the company, resulting in a relatively short period of PT OFFISTARINDO ADHIPRIMA has been known as a reliable source for "Educational Tools, Office, and Audio Visual" sophisticated and quality', '<p>\n	<span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">PT OFFISTARINDO ADHIPRIMA established since 1990, and with determination and ceaseless hard work of all staff and Board of Directors of the company, resulting in a relatively short period of PT OFFISTARINDO ADHIPRIMA has been known as a reliable source for &quot;Educational Tools, Office, and Audio Visual&quot; sophisticated and quality.&nbsp;</span></p>\n<p>\n	&nbsp;</p>\n<p style="margin: 8px 0px; padding: 0px; line-height: 1.7em; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; font-size: 13px;">\n	<span style="margin: 0px; padding: 0px; font-size: small;">With the support of the principals of Foreign Affairs and sales network, as well as sales from dealers dealers spread across Indonesia, PT OFFISTARINDO ADHIPRIMA trying to also write the best service to its customers, according to the company motto is: &quot;WE STRIVE TO SERVE YOU BEST &quot;.&nbsp;</span></p>\n<p>\n	<span style="font-size:12px;">CUSTOMER satisfaction becomes prioditas PT OFFISTARINDO ADHIPRIMA, who also write the guarantee for the continuity of the company.&nbsp;</span></p>\n<p>\n	<span style="font-size:12px;">The products are officially designated as &quot;SOLE DISTRIBUTOR&quot; of principals principals of various countries, among others:&nbsp;</span></p>\n<div id="cke_pastebin">\n	&nbsp;</div>\n<div id="cke_pastebin">\n	<ul style="margin: 10px 0px; padding: 0px 0px 0px 15px; list-style-position: outside; list-style-type: square; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; font-siz