x;">AKASHI</strong></span><strong style="margin: 0px; padding: 0px;">&nbsp;, Fire Proof Safe and Cash Box, Ex Korea.</strong></span></li>\n		<li style="margin: 0px; padding: 0px; line-height: 1.7em;">\n			<span style="margin: 0px; padding: 0px; font-size: small;"><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0);"><strong style="margin: 0px; padding: 0px;">ROYAL</strong></span><strong style="margin: 0px; padding: 0px;">&nbsp;, Finger print and Face detection (mesin absensi sidik Jari &amp; wajah).</strong></span></li>\n		<li style="margin: 0px; padding: 0px; line-height: 1.7em;">\n			<span style="margin: 0px; padding: 0px; font-size: small;"><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0);"><strong style="margin: 0px; padding: 0px;">ROYAL</strong></span><strong style="margin: 0px; padding: 0px;">, Mesin tik manual</strong></span></li>\n		<li style="margin: 0px; padding: 0px; line-height: 1.7em;">\n			<span style="margin: 0px; padding: 0px; font-size: small;"><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0);"><strong style="margin: 0px; padding: 0px;">BXB</strong></span><strong style="margin: 0px; padding: 0px;">&nbsp;, paging system, Ex Taiwan.</strong></span></li>\n		<li style="margin: 0px; padding: 0px; line-height: 1.7em;">\n			<span style="margin: 0px; padding: 0px; font-size: small;"><strong style="margin: 0px; padding: 0px;">Dll.</strong></span></li>\n	</ul>\n</div>\n<p style="margin: 8px 0px; padding: 0px; line-height: 1.7em; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; font-size: 13px;">\n	<span style="margin: 0px; padding: 0px; font-size: small;">All products products handled by PT OFFISTARINDO ADHIPRIMA been through the selection of the quality as well as, a guarantee of principal that can be justified, where most of these products have been certified International include: ISO 9001 and ISO 14001 (for the environment).</span></p>'),
(2, 1, 2, 'Tentang Kami', 'PT OFFISTARINDO ADHIPRIMA berdiri sejak tahun 1990, dan dengan tekad dan kerja keras yang tanpa hentinya dari seluruh Staff dan Direksi perusahaan ,sehingga dalam waktu relatif singkat perusahaan PT OFFISTARINDO ADHIPRIMA telah dikenal sebagai Sumber yang terpercaya untuk “Peralatan Pendidikan , Perkantoran, dan Audio Visual” yang canggih dan berkwalitas.', '<p>\n	<span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">PT OFFISTARINDO ADHIPRIMA berdiri sejak tahun 1990, dan dengan tekad dan kerja keras yang tanpa hentinya dari seluruh Staff dan Direksi perusahaan ,sehingga dalam waktu relatif singkat perusahaan PT OFFISTARINDO ADHIPRIMA telah dikenal sebagai Sumber yang terpercaya untuk &ldquo;Peralatan Pendidikan , Perkantoran, dan Audio Visual&rdquo; yang canggih dan berkwalitas.</span></p>\n<p>\n	&nbsp;</p>\n<p style="margin: 8px 0px; padding: 0px; line-height: 1.7em; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; font-size: 13px;">\n	<span style="margin: 0px; padding: 0px; font-size: small;">Dengan dukungan dari pihak prinsipal dari Luar negeri dan jaringan penjualan ,serta purna jual dari dealer dealer yang tersebar di seluruh Indonesia, PT OFFISTARINDO ADHIPRIMA berusaha untuk menberikan pelayanan yang terbaik untuk para pelanggannya, sesuai dengan motto perusahaan yaitu : &ldquo; WE STRIVE TO SERVE YOU BEST &ldquo;.</span></p>\n<p style="margin: 8px 0px; padding: 0px; line-height: 1.7em; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; font-size: 13px;">\n	<span style="margin: 0px; padding: 0px; font-size: small;">Kepuasan KONSUMEN menjadi prioditas PT OFFISTARINDA ADHIPRIMA, yang menberikan jaminan untuk kelangsungan perusahaan.</span></p>\n<p style="margin: 8px 0px; padding: 0px; line-height: 1.7em; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; font-size: 13px;">\n	<span style="margin: 0px; padding: 0px; font-s