e="margin: 0px; padding: 0px;">, Intellegent Projector (All in One Projector), Ex Jepang.</strong></span></li>\n	<li style="margin: 0px; padding: 0px; line-height: 1.7em;">\n		<span style="margin: 0px; padding: 0px; font-size: small;"><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0);"><strong style="margin: 0px; padding: 0px;">AKASHI</strong></span><strong style="margin: 0px; padding: 0px;">&nbsp;, Fire Proof Safe and Cash Box, Ex Korea.</strong></span></li>\n	<li style="margin: 0px; padding: 0px; line-height: 1.7em;">\n		<span style="margin: 0px; padding: 0px; font-size: small;"><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0);"><strong style="margin: 0px; padding: 0px;">ROYAL</strong></span><strong style="margin: 0px; padding: 0px;">&nbsp;, Finger print and Face detection (mesin absensi sidik Jari &amp; wajah).</strong></span></li>\n	<li style="margin: 0px; padding: 0px; line-height: 1.7em;">\n		<span style="margin: 0px; padding: 0px; font-size: small;"><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0);"><strong style="margin: 0px; padding: 0px;">ROYAL</strong></span><strong style="margin: 0px; padding: 0px;">, Mesin tik manual</strong></span></li>\n	<li style="margin: 0px; padding: 0px; line-height: 1.7em;">\n		<span style="margin: 0px; padding: 0px; font-size: small;"><span style="margin: 0px; padding: 0px; color: rgb(255, 0, 0);"><strong style="margin: 0px; padding: 0px;">BXB</strong></span><strong style="margin: 0px; padding: 0px;">&nbsp;, paging system, Ex Taiwan.</strong></span></li>\n	<li style="margin: 0px; padding: 0px; line-height: 1.7em;">\n		<span style="margin: 0px; padding: 0px; font-size: small;"><strong style="margin: 0px; padding: 0px;">Dll.</strong></span></li>\n</ul>\n<p style="margin: 8px 0px; padding: 0px; line-height: 1.7em; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; font-size: 13px;">\n	<span style="margin: 0px; padding: 0px; font-size: small;">Seluruh produk produk yang ditangani oleh PT OFFISTARINDO ADHIPRIMA telah melalui penyeleksian mengenai mutu serta, jaminan dari prinsipal yang dapat dipertanggung jawabkan,dimana sebagian besar produk produk tersebut&nbsp; telah memiliki sertifikat International antara lain : ISO 9001 maupun ISO 14001 (untuk lingkungan hidup).</span></p>\n'),
(3, 2, 1, 'History', 'PT OFFISTARINDO ADHIPRIMA established since 1990, and with determination and ceaseless hard work of all staff and Board of Directors of the company, resulting in a relatively short period of PT OFFISTARINDO ADHIPRIMA has been known as a reliable source for "Educational Tools, Office, and Audio Visual" sophisticated and quality.\n\nWith the support of the principals of Foreign Affairs and sales network, as well as sales from dealers dealers spread across Indonesia, PT OFFISTARINDO ADHIPRIMA trying to also write the best service to its customers, according to the company motto is: "WE STRIVE TO SERVE YOU BEST\n\nCUSTOMER satisfaction becomes prioditas PT OFFISTARINDO ADHIPRIMA, who also write the guarantee for the continuity of the company.', '<p>\n	&nbsp;<span class="hps">PT</span> <span class="hps">OFFISTARINDO</span> <span class="hps">ADHIPRIMA</span> <span class="hps">established</span> <span class="hps">since 1990</span>, <span class="hps">and</span> <span class="hps">with</span> <span class="hps">determination</span> <span class="hps">and</span> <span class="hps">ceaseless</span> <span class="hps">hard work</span> <span class="hps">of all</span> <span class="hps">staff</span> <span class="hps">and</span> <span class="hps">Board of Directors of</span> <span class="hps">the company</span><span>, resulting</span> <span class="hps">in a</span> <span class="hps">relatively</span> <span class="hps">short</span> <span class="hps">period</span> <span class="hps">of PT</span> <span class="hps">OFFISTARINDO</span> <span class="hps">ADHIPRIMA</span> <span class="hps">has been</span> <span class="hps">known as a</span> <span class="hps">reliable</span> <span class="hps">source</span> <span class="hps">for</span> <span class="hps atn">&quot;</span>Educational <span class="hps">Tools</span>, <span class="hps">Office</span>, <span class="hps">and</span> <span class="hps">Audio</span> <span class="hps">Visual</span>&quot; <span class="hps">sophisticated</span> <span class="hps">and</span> <span class="hps">quality</span>.</p>\n<p>\n	<span class="long_text" id="result_box" lang="en"><br />\n	<span class="hps">With the support</span> <span class="hps">of</span> <span class="hps">the principals</span> <span class="hps">of</span> <span class="hps">Foreign Affairs</span> <span class="hps">and</span> <span class="hps">sales network</span>, <span class="hps">as well as</span> <span class="hps">sales</span> <span class="hps">from</span> <span class="hps">dealers</span> <span class="hps">dealers spread</span> <span class="hps">across Indonesia</span>, <span class="hps">PT</span> <span class="hps">OFFISTARINDO</span> <span class="hps">ADHIPRIMA</span> <span class="hps">trying</span> <span class="hps">to</span> <span class="hps">also write</span> <span class="hps">the best service</span> <span class="hps">to</span> <span class="hps">its customers</span>, <span class="hps">according</span> <span class="hps">to the company motto</span> <span class="hps">is:</span> <span class="hps atn">&quot;</span>WE <span class="hps">STRIVE</span> <span class="hps">TO</span> <span class="hps">SERVE</span> <span class="hps">YOU</span> <span class="hps">BEST</span><br />\n	<br />\n	<span class="hps">CUSTOMER</span> <span class="hps">satisfaction</span> <span class="hps">becomes</span> <span class="hps">prioditas</span> <span class="hps">PT</span> <span class="hps">OFFISTARINDO</span> <span class="hps">ADHIPRIMA</span>, <span class="hps">who</span> <span class="hps">also write</span> <span class="hps">the guarantee</span> <span class="hps">for</span> <span class="hps">the continuity of</span> <span class="hps">the company</span><span>.</span></span></p>\n'),
(4, 2, 2, 'Sejarah', 'PT OFFISTARINDO ADHIPRIMA berdiri sejak tahun 1990, dan dengan tekad dan kerja keras yang tanpa hentinya dari seluruh Staff dan Direksi perusahaan ,sehingga dalam waktu relatif singkat perusahaan PT OFFISTARINDO ADHIPRIMA telah dikenal sebagai Sumber yang terpercaya untuk “Peralatan Pendidikan , Perkantoran, dan Audio Visual” yang canggih dan berkwalitas.', '<p>\n	&nbsp;PT OFFISTARINDO ADHIPRIMA berdiri sejak tahun 1990, dan dengan tekad dan kerja keras yang tanpa hentinya dari seluruh Staff dan Direksi perusahaan ,sehingga dalam waktu relatif singkat perusahaan PT OFFISTARINDO ADHIPRIMA telah dikenal sebagai Sumber yang terpercaya untuk &ldquo;Peralatan Pendidikan , Perkantoran, dan Audio Visual&rdquo; yang canggih dan berkwalitas.</p>\n<p>\n	Dengan dukungan dari pihak prinsipal dari Luar negeri dan jaringan penjualan ,serta purna jual dari dealer dealer yang tersebar di seluruh Indonesia, PT OFFISTARINDO ADHIPRIMA berusaha untuk menberikan pelayanan yang terbaik untuk para pelanggannya, sesuai dengan motto perusahaan yaitu : &ldquo; WE STRIVE TO SERVE YOU BEST</p>\n<p>\n	Kepuasan KONSUMEN menjadi prioditas PT OFFISTARINDO ADHIPRIMA, yang menberikan jaminan untuk kelangsungan perusahaan.</p>\n'),
