INSERT INTO `tbl_product_content` (`id`, `product_id`, `lang_id`, `subject`, `text`, `overview`, `features`, `specification`) VALUES
(18, 20, 2, 'AHA DPL 195', '<h4>\n	<span style="font-size: 14px;">Desain stylish dengan performa tinggi, body kokoh dari besi, dan sistem digital canggih. </span></h4>\n<h4>\n	<span style="font-size: 14px;"><span style="color:#ffa500;"><u>Kontrol audio visual</u></span> seluruhnya terintegrasi dalam podium.</span></h4>\n', '<h4>\n	<span style="font-size: 14px;">Menulis, menggambar, dan perangkat lunak perekam video tersedia dalam sistem &quot;Edupen Pro&quot;.</span></h4>\n<h4>\n	<span style="font-size: 14px;"><span style="color:#ffa500;"><u>Mendukung sistem operasi</u></span> Windows 98 / ME / 2000 / XP / Vista / 7.</span></h4>\n<h4>\n	<span style="font-size: 14px;">Seluruh perangkat multimedia, dan materi pengajaran dapat dihubungkan dan dikolaborasikan dengan sistem podium.</span></h4>\n', '<h4>\n	<span style="font-size:14px;">- Suara jernih</span></h4>\n<h4>\n	<span style="font-size:14px;">- Dapat dikunci setelah selesai digunakan</span></h4>\n<h4>\n	<span style="font-size:14px;">- Mudah untuk mengedit pekerjaan</span></h4>\n<h4>\n	<span style="font-size:14px;">- Mendukung perangkat lunak penulisan digital</span></h4>\n<h4>\n	<span style="font-size:14px;">- Dioptimalkan untuk presentasi</span></h4>\n<h4>\n	<span style="font-size:14px;">- Menulis bagaikan menulis pada kertas</span></h4>\n<h4>\n	<span style="font-size:14px;">- Mendukung berbagai format media putar dan perekaman.</span></h4>\n', '<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Ukuran</span> : 678(W) x 1054(H) x 680(D) mm</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Berat</span> : 70Kg</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Berat ekspedisi</span> : 110Kg</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Ukuran ekspedisi</span> : 794(W) x 1411(H) x 860(D) mm</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Perangkat lunak</span> : Integrated Podium Software, Edupen-Pro</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Sudut pandang</span> : 19inch wide (Wide angle display Monitor)&nbsp;</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Teknologi sentuh</span> : Pen-touch technology based on Digitizer technology.</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Audio</span> : Integrated Amplifier</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Konsumsi daya</span> : sampai dengan 150W</span></h4>\n'),
(17, 20, 1, 'AHA DPL 195', '<div id="cke_pastebin">\n	<h4>\n		<span style="font-size: 14px;">Stylish design with stepped up performance, a strong steel body, and cutting edge digital power. </span></h4>\n	<h4>\n		<span style="font-size: 14px;"><span style="color:#ffa500;"><u>Control AMP</u></span> and <span style="color:#ffa500;"><u>audio video</u></span> controls are all contained within the podium.</span></h4>\n	<div id="cke_pastebin">\n		<span style="font-size:14px;"><br />\n		</span></div>\n	<div id="cke_pastebin">\n		<span style="font-size:14px;"><br />\n		</span></div>\n	<div id="cke_pastebin">\n		&nbsp;</div>\n</div>\n', '<div id="cke_pastebin">\n	<h4>\n		<span style="font-size: 14px;">Writing, drawing, and video recording software all available with &quot;Edupen Pro&quot; system.</span></h4>\n	<h4>\n		<span style="font-size: 14px;">RMS system available (optional).</span></h4>\n	<h4>\n		<span style="font-size: 14px;"><span style="color:#ff8c00;">Supported OS</span>: Win 98 / ME / 2000 / XP / Vista / 7.</span></h4>\n	<h4>\n		<span style="font-size: 14px;"><span style="color:#ffa500;">Writing input S/W</span>: Edupen Pro.</span></h4>\n	<h4>\n		<span style="font-size: 14px;">All multimedia equipment, and teaching materials can be connected and supported.</span></h4>\n</div>\n<ul>\n</ul>\n', '<h4>\n	<span style="font-size:14px;">- Clear Sound</span></h4>\n<h4>\n	<span style="font-size:14px;">- Function of locking after finishing works</span></h4>\n<h4>\n	<span style="font-size:14px;">- Easy &amp; prompt editing works</span></h4>\n<h4>\n	<span style="font-size:14px;">- Supporting writing software</span></h4>\n<h4>\n	<span style="font-size:14px;">- Optimized for Presentation</span></h4>\n<h4>\n	<span style="font-size:14px;">- Writing feeling like actual writing</span></h4>\n<h4>\n	<span style="font-size:14px;">- Support various media content</span></h4>\n<h4>\n	<span style="font-size:14px;">- Support various recording function</span></h4>\n', '<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Size</span> : 678(W) x 1054(H) x 680(D) mm</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Weight</span> : 70Kg</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Shipping Weight</span> : 110Kg</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Shipping Size</span> : 794(W) x 1411(H) x 860(D) mm</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Software</span> : Integrated Podium Software, Edupen-Pro</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">View Angle</span> : 19inch wide (Wide angle display Monitor)&nbsp;</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Touch Technology</span> : Pen-touch technology based on Digitizer technology.</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Audio</span> : Integrated Amplifier</span></h4>\n<h4>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Power Consumption</span> : Up to 150W</span></h4>\n'),
(22, 22, 2, 'AHA ELF-22D', '<h5>\n	<span style="font-size:14px;">Podium Digital adalah sebuah alat presentasi terintegrasi yang memudahkan pembicara menyampaikan bahan / materi kepada peserta dengan menyajikan bahan / materi digital berupa <span style="color:#ffa500;"><u>slide presentasi, gambar, suara, video, dan konten interne</u>t</span> yang dapat ditandai langsung melalui monitor yang terintegrasi di dalam podium.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Podium digital juga memberikan fasilitas untuk merekam segala aktivitas yang dilakukan dalam ruang pertemuan / meeting terkait dengan materi digital.</span></h5>\n<h5>\n	<span style="font-size:14px;">Dilengkapi sound system terintegrasi seperti amplifier, mikrofon gooseneck dan wireless, serta port penghubung peralatan multimedia atau digital lain sehingga seluruh fasilitas presentasi yang ada dapat dioptimalkan. Selain itu melalui tablet touchscreen yang tersedia, pembicara dapat mengatur volume suara, proyektor, layar, dan lampu ruangan dengan mudah dan cepat.</span></h5>\n', '<div id="cke_pastebin">\n	<span style="font-size:14px;">- Podium digital dilengkapi dengan sistem dua monitor</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;">- Komputer tablet layar sentuh sebagai pengendali sistem suara, proyektor, layar, dan lampu ruangan.</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;">- Built-in <span style="color:#ffa500;"><u>RFID</u></span> controller, fitur untuk pengamanan dan kontrol otomatis.</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;">- Kemampuan menulis dan menggambar secara digital pada layar monitor yang dapat direkam.</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;">- Desain ergonomis, simple, dan minimalis</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;">- Mendukung sistem operasi (OS) menggunakan Windows 98 / ME / 2000 / XP / Vista / 7.</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;">- Segala peralatan multimedia dapat disambungkan / dikoneksikan sehingga materi presentasi dapat dimainkan / diputar dengan peralatan multimedia tersebut.</span></div>\n', '<div id="cke_pastebin">\n	<span style="font-size:14px;"><span style="color:#ffa500;">Ukuran</span> : 659(W) &nbsp;x 1,130(H) &nbsp;x 750(D) mm</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Berat</span> : 70 kg</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;"><span style="color:#ffa500;">Ukuran ekspedisi</span> : 804(W) x 909(H) x 1,311(D) mm</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Berat ekspedisi</span> : 110 kg</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;"><span style="color:#ffa500;">Perangkat lunak</span> : Integrated Podium Software, Edupen-Pro</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;"><span style="color:#ffa500;">Sudut pandangan</span> : 19inch wide ( Wide angle display Monitor)</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;"><span style="color:#ffa500;">Teknologi sentuhan</span> : Pen-touch technology based on Digitizer technology.</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;"><span style="color:#ffa500;">Audio</span> : Integrated Amplifier</span></div>\n<div id="cke_pastebin">\n	<span style="font-size:14px;"><span style="color:#ffa500;">Konsumsi daya</span> : Up to 150W</span></div>\n'),
(21, 22, 1, 'AHA ELF-22D', '<h5>\n	<span style="font-size: 14px;">The Elf system allows the user to write on a tablet monitor built into the podium.</span></h5>\n<h5>\n	<span style="font-size:14px;">The <span style="color:#ff8c00;"><u>core technology system</u></span> allows the user to write directly on a multimedia based <span style="color:#ffa500;"><u>teaching plan</u></span> and save the <span style="color:#ff8c00;"><u>images</u></span> or <span style="color:#ffa500;"><u>video </u></span>along with the <span style="color:#ffa500;"><u>voice</u></span>, for the easy production of multimedia learning contents.</span></h5>\n', '<h5>\n	<span style="font-size: 14px;">The Elf system allows the user to write on a tablet monitor built into the podium.</span></h5>\n<h5>\n	<span style="font-size: 14px;">The core technology system allows the user to write directly on a multimedia based teaching plan and save the images or video along with the voice, for the easy production of multimedia learning contents.</span></h5>\n', '<h5>\n	<span style="font-size: 14px;">- The world&#39;s first <span style="color:#ffa500;"><u>dual monitor podium system</u></span>.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Interactive tablet monitor and standard sub display.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in <span style="color:#ffa500;"><u>RFID system</u></span> for control and security.</span></h5>\n<h5>\n	<span style="font-size:14px;">- <span style="color:#ffa500;"><u>RMS</u></span> (Remote Monitoring System) available as an option.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Compatible with all operating systems, multimedia, equipment, and teaching materials.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Edupen Pro interactive software included.</span></h5>\n', '<h5>\n	<span style="font-size: 14px;"><span style="color:#ff8c00;">Size</span> : 659(W) &nbsp;x 1,130(H) &nbsp;x 750(D) mm</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Weight</span> : 70 kg</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Shipping Weight</span> : 110 kg</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Shipping Size</span> : 804(W) x 909(H) x 1,311(D) mm</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Software</span> : Integrated Podium Software, Edupen-Pro</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">View Angle</span> : 19inch wide ( Wide angle display Monitor)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Touch Technology</span> : Pen-touch technology based on Digitizer technology.</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Audio</span> : Integrated Amplifier</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Power Consumption</span> : Up to 150W</span></h5>\n'),
(23, 23, 1, 'AHA ELF-192D', '<h5>\n	<span style="font-size:14px;">The Elf system allows the user to write on a tablet monitor built into the podium.</span></h5>\n<h5>\n	<span style="font-size:14px;">The core technology system allows the user to write directly on a multimedia based teaching plan and save the images or video along with the voice, for the easy production of multimedia learning contents.</span></h5>\n<h5>\n	<span style="font-size:14px;">The Elf has a built-in sound system (amplifier, wired/wireless microphone, etc..) for e-learning and can be interfaced with all multimedia devices and facilities that the user might employ as teaching or communication tools. The embedded integrated controller allows for the control of devices with a single key and supports plug &amp; play function. An additional 19&rdquo; LCD monitor allows the presenter to manage contents, notes, and materials separate from what is being presented.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">The Elf system allows the user to write on a tablet monitor built into the podium.</span></h5>\n<h5>\n	<span style="font-size:14px;">The core technology system allows the user to write directly on a multimedia based teaching plan and save the images or video along with the voice, for the easy production of multimedia learning contents.</span></h5>\n', '<h5>\n	<span style="font-size: 14px;">- The world&#39;s <span style="color:#ffa500;"><u>first dual monitor</u></span> podium system.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Interactive tablet monitor and standard sub display.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in <span style="color:#ff8c00;"><u>RFID</u></span> system for control and security.</span></h5>\n<h5>\n	<span style="font-size:14px;">- <span style="color:#ff8c00;"><u>RMS</u></span> (Remote Monitoring System) available as an option.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Compatible with all operating systems, multimedia, equipment, and teaching materials.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Edupen Pro interactive software included.</span></h5>\n', '<h5>\n	<span style="font-size: 14px;"><span style="color:#ffa500;">Size</span> : 659(W) &nbsp;x 1,130(H) &nbsp;x 750(D) mm</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Weight</span> : 70 kg</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Shipping Weight</span> : 110 kg</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Shipping Size</span> : 804(W) x 909(H) x 1,311(D) mm</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Software</span> : Integrated Podium Software, Edupen-Pro</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ffa500;">View Angle</span> : 19inch wide ( Wide angle display Monitor)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Touch Technology</span> : Pen-touch technology based on Digitizer technology.</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Audio</span> : Integrated Amplifier</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Power Consumption</span> : Up to 150W</span></h5>\n'),
(24, 23, 2, 'AHA ELF-192D', '<h5>\n	<span style="font-size:14px;">Podium Digital adalah sebuah alat presentasi terintegrasi yang memudahkan pembicara menyampaikan bahan / materi kepada peserta dengan menyajikan bahan / materi digital berupa slide presentasi, gambar, suara, video, dan konten internet yang dapat ditandai langsung melalui monitor yang terintegrasi di dalam podium.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Podium Digital adalah sebuah alat presentasi terintegrasi yang memudahkan pembicara menyampaikan bahan / materi kepada peserta dengan menyajikan bahan / materi digital berupa slide presentasi, gambar, suara, video, dan konten internet yang dapat ditandai langsung melalui monitor yang terintegrasi di dalam podium.</span></h5>\n<h5>\n	<span style="font-size:14px;">Podium digital juga memberikan fasilitas untuk merekam segala aktivitas yang dilakukan dalam ruang pertemuan / meeting terkait dengan materi digital.</span></h5>\n<h5>\n	<span style="font-size:14px;">Dilengkapi sound system terintegrasi seperti amplifier, mikrofon gooseneck dan wireless, serta port penghubung peralatan multimedia atau digital lain sehingga seluruh fasilitas presentasi yang ada dapat dioptimalkan. Selain itu melalui tablet touchscreen yang tersedia, pembicara dapat mengatur volume suara, proyektor, layar, dan lampu ruangan dengan mudah dan cepat.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">- Podium digital dilengkapi dengan <span style="color:#ff8c00;"><u>sistem dua monitor</u></span></span></h5>\n<h5>\n	<span style="font-size:14px;">- Komputer tablet layar sentuh sebagai pengendali sistem suara, proyektor, layar, dan lampu ruangan.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in <span style="color:#ff8c00;"><u>RFID controller</u></span>, fitur untuk pengamanan dan kontrol otomatis.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Kemampuan menulis dan menggambar secara digital pada layar monitor yang dapat direkam.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Desain ergonomis, simple, dan minimalis</span></h5>\n<h5>\n	<span style="font-size:14px;">- Mendukung sistem operasi (OS) menggunakan Windows 98 / ME / 2000 / XP / Vista / 7.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Segala peralatan multimedia dapat disambungkan / dikoneksikan sehingga materi presentasi dapat dimainkan / diputar dengan peralatan multimedia tersebut.</span></h5>\n', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Ukuran</span> : 659(W) &nbsp;x 1,130(H) &nbsp;x 750(D) mm</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Berat</span> : 70 kg</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Ukuran ekspedisi</span> : 804(W) x 909(H) x 1,311(D) mm</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Berat ekspedisi</span> : 110 kg</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Perangkat lunak</span> : Integrated Podium Software, Edupen-Pro</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Sudut pandangan</span> : 19inch wide ( Wide angle display Monitor)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Teknologi sentuhan</span> : Pen-touch technology based on Digitizer technology.</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Audio</span> : Integrated Amplifier</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Konsumsi daya</span> : Up to 150W</span></h5>\n'),
(25, 24, 1, 'Lumens CL 510', '<h5>\n	<span style="font-size: 14px;"><span style="color:#ff8c00;"><u>CL510</u></span> is design to be suspended or embedded into the ceiling to keep the presenter desktop or lectern neat and clean. If required power can be provided via the <span style="color:#ff8c00;">PoE (Power over Ethernet)</span> function, providing a completely clear line of sight between the presenter and their audience.</span></h5>\n', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">CL510</span> is design to be suspended or embedded into the ceiling to keep the presenter desktop or lectern neat and clean. If required power can be provided via the PoE (Power over Ethernet) function, providing a completely clear line of sight between the presenter and their audience. The <span style="color:#ff8c00;">CL510 </span>supports Full HD-1080p resolution and is equipped with a high class image sensor, professional 25x optical zoom, superior frame rate to provide high color reproduction, no distortion, blur-free, and vivid image quality. Through a professional networked installation the CL510 an effective and efficient distance learning tool while also allowing video conferencing and medical application like the use of real time image transmission from operation room. A ceiling mounted document camera is the ideal solution to break the limitations of space for professional presentations.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Full HD 1080p high-definition output resolution</span></h5>\n<h5>\n	<span style="font-size:14px;">One button optimization function</span></h5>\n<h5>\n	<span style="font-size:14px;">Intelligent time stamp on saved files</span></h5>\n<h5>\n	<span style="font-size:14px;">High-definition USB image transmission in real time</span></h5>\n<h5>\n	<span style="font-size:14px;">Plug-and-Play, no need to install USB driver</span></h5>\n<h5>\n	<span style="font-size:14px;">Customized video splash screen</span></h5>\n<h5>\n	<span style="font-size:14px;">Projector type (DLP/LCD) select mode</span></h5>\n<h5>\n	<span style="font-size:14px;">Free multi-functional cross platform software support</span></h5>\n<h5>\n	<span style="font-size:14px;">Compatible with all major IWB brands</span></h5>\n', '<h5>\n	<span style="font-size:14px;"><span style="color:#ffa500;">Zoom Capacity</span> : 25x optical zoom and 5x digital zoom</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Output Resolution</span> : XGA, SXGA, UXGA, WXGA, 1080p</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Ethernet</span> : for video streaming and remote control</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Capture Area Max</span>. : 1200 x 900 mm (47.2&quot; x 35.4&quot;)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Frame Rate</span> : Up to 30 fps</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Signal Output</span> : VGA x 1, DVI x 1, USB x 1, Ethernet x 1</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">USB Flash Drive</span> : Up to 32GB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Built-in Memory </span>: 120 JPEG images</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">USB Support</span> : High Speed 2.0 (480 Mbps) Transmission</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Video Recording</span> : Standalone or via software</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Image Capture</span> : Single or continuous capturing (time lapse photography) to internal memory, USB flash drive, or to the computer via USB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Auto Tune</span> : Yes, Single button to adjust for best possible images</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Picture by Picture (PBP)</span> : Yes, compare live images with saved images</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Slide Show</span> : Automatically or manually</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Image Rotation</span> : Full screen image rotation from 0, 90, 180, to 270 degrees</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Pan Across the Screen</span> : Enlarge any part of the image and pan it&nbsp;</span><span style="font-size: 14px;">by using the arrow keys</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Color Reproduction</span> : ?E*ab 8.84 (mean)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">SNR</span> : 52 dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Sharpness</span> : MTF 900 lines</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Anti-Theft</span> : kensington lock port on document camera chassis</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Weight</span> : 0.8 Kg</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Dimension(LxWxH)</span> : 86x126x135 mm</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Podium View&trade; Software Support</span> PC Windows 8, 7, XP, Vista and Mac OSX; WIA &amp; TWAIN interface</span></h5>\n'),
(26, 24, 2, 'Lumens CL 510', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;"><u>CL510</u></span> dirancang untuk dipasang di langit-langit ruangan agar meja presenter lebih rapih dan bersih. Memiliki fungsi <span style="color:#ff8c00;">PoE (Power Over Ethernet)</span> untuk menggunakan sumber daya listrik melalui kabel Ethernet yang merupakan solusi ekonomis dan mudah digunakan</span></h5>\n', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">CL510</span> dirancang untuk dipasang di langit-langit ruangan agar meja presenter lebih rapih dan bersih. Memiliki fungsi <span style="color:#ff8c00;">PoE (Power Over Ethernet)</span> untuk menggunakan sumber daya listrik melalui kabel Ethernet yang merupakan solusi ekonomis dan mudah digunakan, CL510 mendukung resolusi <span style="color:#ff8c00;">full HD 1080p</span>, dan dilengkapi dengan sensor gambar kualitas tinggi, optical zoom 25x, frame rate tinggi untuk menghasilkan gambar dengan kualitas tinggi, berwarna terang, tanpa distorsi, dan jernih.</span></h5>\n<h5>\n	<span style="font-size:14px;">Dengan pemasangan jaringan professional, <span style="color:#ff8c00;">CL510 </span>memungkinkan presenter untuk mengirimkan gambar secara live dan mengendalikan seluruh fungsi secara remote, dengan pengaplikasian utamanya sebagai layanan distance learning (pembelajaran jarak jauh), dan dunia kesehatan (transmisi live dari ruang operasi). Dokumen kamera ceiling-mounted merupakan solusi yang ideal dalam masalah keterbatasan ruang untuk melakukan presentasi yang profesional.</span></h5>\n', '<ul>\n	<li>\n		<h5>\n			<span style="font-size:14px;">Resolusi output definisi tinggi <span style="color:#ff8c00;">full HD 1080p</span></span></h5>\n	</li>\n	<li>\n		<h5>\n			<span style="font-size:14px;">Fungsi optimisasi dengan satu sentuhan tombol</span></h5>\n	</li>\n	<li>\n		<h5>\n			<span style="font-size:14px;">Time stamp &#39;pintar&#39; untuk penyimpanan file</span></h5>\n	</li>\n	<li>\n		<h5>\n			<span style="font-size:14px;">Transmisi gambar definisi tinggi dari USB secara real time</span></h5>\n	</li>\n	<li>\n		<h5>\n			<span style="font-size:14px;">Plug &amp; Play, tidak memerlukan instalasi driver</span></h5>\n	</li>\n	<li>\n		<h5>\n			<span style="font-size:14px;">Kustomisasi Splash Screen</span></h5>\n	</li>\n	<li>\n		<h5>\n			<span style="font-size:14px;">2 piliham mode projector, DLP atau LCD</span></h5>\n	</li>\n	<li>\n		<h5>\n			<span style="font-size:14px;">Didukung software multifungsi yang cross-platform</span></h5>\n	</li>\n	<li>\n		<h5>\n			<span style="font-size:14px;">Kompatibel dengan seluruh merek IWB terkemuka</span></h5>\n	</li>\n</ul>\n', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Zoom Capacity</span> : 25x optical zoom and 5x digital zoom</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Output Resolution</span> : XGA, SXGA, UXGA, WXGA, 1080p</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Ethernet </span>: for video streaming and remote control</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Capture Area Max</span>. : 1200 x 900 mm (47.2&quot; x 35.4&quot;)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Frame Rate</span> : Up to 30 fps</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Signal Output</span> : VGA x 1, DVI x 1, USB x 1, Ethernet x 1</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">USB Flash Drive</span> : Up to 32GB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Built-in Memory</span> : 120 JPEG images</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">USB Support</span> : High Speed 2.0 (480 Mbps) Transmission</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Video Recording</span> : Standalone or via software</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Image Capture</span> : Single or continuous capturing (time lapse photography) to internal memory, USB flash drive, or to the computer via USB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Auto Tune </span>: Yes, Single button to adjust for best possible images</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Picture by Picture (PBP)</span> : Yes, compare live images with saved images</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Slide Show</span> : Automatically or manually</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Image Rotation</span> : Full screen image rotation from 0, 90, 180, to 270 degrees</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Pan Across the Screen</span> : Enlarge any part of the image and pan it&nbsp;</span><span style="font-size: 14px;">by using the arrow keys</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Color Reproduction</span> : ?E*ab 8.84 (mean)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">SNR</span> : 52 dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Sharpness</span> : MTF 900 lines</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Anti-Theft</span> : kensington lock port on document camera chassis</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Weight</span> : 0.8 Kg</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Dimension(LxWxH)</span> : 86x126x135 mm</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Podium View&trade; Software Support</span> PC Windows 8, 7, XP, Vista and Mac OSX; WIA &amp; TWAIN interface</span></h5>\n'),
(27, 25, 1, 'Lumens DC 192', '<h5>\n	<span style="font-size: 14px;"><span style="color:#ff8c00;">The Lumens DC192</span> document camera has 16x zoom capability (8x optical zoom, 2x sensor zoom) and a professional image sensor to deliver vivid colors at high-definition, Full HD, 1080p output resolutions with 30 frames per second. It transmit a streaming image smoothly in real time withouts delays.&nbsp;</span></h5>\n', '<h5>\n	<span style="font-size: 14px;"><span style="color:#ff8c00;">The Lumens DC192</span> document camera has 16x zoom capability (8x optical zoom, 2x sensor zoom) and a professional image sensor to deliver vivid colors at high-definition, Full HD, 1080p output resolutions with 30 frames per second. It transmit a streaming image smoothly in real time withouts delays.&nbsp;</span><span style="font-size: 14px;">The internal memory stores up to 240 images and is expandable to 32GB using a USB flash drive. One-touch video recording allows for recording stand-alone presentations without the need for a PC. The jointless, highly flexible gooseneck enables a 360 viewing angle and object viewing from just 1.2 inch (3 cm) to observe an object&#39;s finer details. The adjustable side lamp design prevents reflections. Single-button auto-tune provides the perfect image quality every time. The Lumens DC192 is a high-resolutions multimedia document camera that makes presentations and teaching mire interactive and attractive.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">- Full HD, 1080p output resolution</span></h5>\n<h5>\n	<span style="font-size:14px;">- High speed 30fps dynamic image</span></h5>\n<h5>\n	<span style="font-size:14px;">- VGA and HDMI input/output</span></h5>\n<h5>\n	<span style="font-size:14px;">- Professional 16x zoom capability</span></h5>\n<h5>\n	<span style="font-size:14px;">- Superior sensor delivery and crystal-clear image quality</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in microphone</span></h5>\n<h5>\n	<span style="font-size:14px;">- One-touch synchronous audio/video recording</span></h5>\n<h5>\n	<span style="font-size:14px;">- Compatible with USB flash drives, expandable to 32GB</span></h5>\n<h5>\n	<span style="font-size:14px;">- Jointless, highly flexible gooseneck</span></h5>\n<h5>\n	<span style="font-size:14px;">- Plug and play design</span></h5>\n<h5>\n	<span style="font-size:14px;">- Auto Tune Function: Unique Image Optimization</span></h5>\n<h5>\n	<span style="font-size:14px;">- Innovative, Built-in power supply</span></h5>\n<h5>\n	<span style="font-size:14px;">- Compatible with all major brands of interactive whiteboards</span></h5>\n', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Zoom</span> : 16x (8x optical zoom; 2 sensor zoom)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Digital Zoom </span>: 12x</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Mechanical Zoom</span> : 10x</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Close-up</span> : 30 mm (1.2&rdquo;)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Shooting Area Max.</span> : 420 x 315 mm (16.5&rdquo; x 12.4&rdquo;) &gt; A3 size</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Output Resolution</span> : XGA, SXGA(1280x960), WXGA, 1080p</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">High Color Reproduction</span> : ?E*ab 14.87 (mean)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">SNR</span> : 51 dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Sharpness</span> : MTF 937 lines</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Frame Rate</span> : 30 fps</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Lamp</span> : LED gooseneck side lamp and head lamp</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Power Supply</span> : Internal power supply, 100-240VAC</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">USB Image Transmission</span> : USB 2.0 (480 Mbps) high-speed transmission</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Video/Audio Recording</span> : One-touch records image and sound synchronously</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Built-in Microphone</span> : Yes</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Image Capture</span> : Single or continuous capturing</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Auto Tune</span> : Yes, one button for image optimization</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Image Rotation</span> : 0&deg;, 180&deg;, flip, mirror</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Anti-Theft</span> : Kensington anti-theft lock device</span></h5>\n<h5>\n	<span style="font-size:14px;">Free Lumens&trade; Software <span class="Apple-tab-span" style="white-space:pre"> </span>Support PC Windows 8, 7, XP, Vista and Mac OSX ; WIA &amp; TWAIN interface</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Included Accessories</span> : Power cable, VGA cable, USB cable, remote control, microscope adapter&nbsp;</span><span style="font-size: 14px;">Weight : 1.9 Kg)&nbsp;</span><span style="font-size: 14px;">Dimension(LxWxH) : [Folded] 230 x 140 x 310 mm, [Open] 420 x 140 x 423 mm</span></h5>\n'),
(28, 25, 2, 'Lumens DC 192', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Dokumen kamera Lumens DC192</span> memiliki kapasitas perbesaran 16x (8x perbesaran optik, 2x perbesaran sensor) dan sensor gambar professional untuk menghasilkan warna cerah pada resolusi high-definition, Full HD, 1080p dengan kecepatan 30 gambar per detik.</span></h5>\n', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Dokumen kamera Lumens DC192</span> memiliki kapasitas perbesaran 16x (8x perbesaran optik, 2x perbesaran sensor) dan sensor gambar professional untuk menghasilkan warna cerah pada resolusi high-definition, Full HD, 1080p dengan kecepatan 30 gambar per detik. Hal ini akan menghasikan gambar streaming yang mulus tanpa keterlambatan. Memori internal dapat menyimpan sampai 240 gambar tanpa memerlukan PC. Tanpa sambungan, leher angsa fleksibel dapat menyorot gambar dalam sudut 360 derajat, dan melihat gambar dari jarak 1.2 inch (3 cm) untuk observasi lebih detil. Lampu samping di desain untuk menghindari pantulan. Pengaturan satu tombol untuk pengaturan praktis guna menghasilkan gambar kualitas sempurna. Lumens DC192 merupakan dokumen kamera high-resolution yang dapat membuat presentasi dan pengajarang lebih interaktif dan menarik.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">- Resolusi output definisi tinggi full HD 1080p</span></h5>\n<h5>\n	<span style="font-size:14px;">- Fungsi optimisasi dengan satu sentuhan tombol</span></h5>\n<h5>\n	<span style="font-size:14px;">- Time stamp &#39;pintar&#39; untuk penyimpanan file</span></h5>\n<h5>\n	<span style="font-size:14px;">- Transmisi gambar definisi tinggi dari USB secara real time</span></h5>\n<h5>\n	<span style="font-size:14px;">- Plug &amp; Play, tidak memerlukan instalasi driver</span></h5>\n<h5>\n	<span style="font-size:14px;">- Kustomisasi Splash Screen</span></h5>\n<h5>\n	<span style="font-size:14px;">- 2 piliham mode projector, DLP atau LCD</span></h5>\n<h5>\n	<span style="font