aved images</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Slide Show</span> : Automatically or manually</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Image Rotation</span> : Full screen image rotation from 0, 90, 180, to 270 degrees</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Pan Across the Screen</span> : Enlarge any part of the image and pan it&nbsp;</span><span style="font-size: 14px;">by using the arrow keys</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Color Reproduction</span> : ?E*ab 8.84 (mean)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">SNR</span> : 52 dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Sharpness</span> : MTF 900 lines</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Anti-Theft</span> : kensington lock port on document camera chassis</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Weight</span> : 0.8 Kg</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Dimension(LxWxH)</span> : 86x126x135 mm</span></h5>\n<h5>\n	<span style="font-size:14px;">Podium View&trade; Software Support PC Windows 8, 7, XP, Vista and Mac OSX; WIA &amp; TWAIN interface</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n'),
(29, 26, 1, 'Lumens PS 760', '<h5>\n	<span style="font-size:14px;">The Lumens PS760 is an adaptable high-definition multimedia document camera. With 20x optical zoom and 1080p / UXGA resolution that delivers clear images and crisp text every time, the Lumens PS760 is ideal for lecture halls and boardrooms and folds to just 15cm (6&quot;) height for storage in a podium or cart.</span></h5>\n', '', '', ''),
(30, 26, 2, 'Lumens PS 760', '<h5>\n	<span style="font-size:14px;">Lumens PS760 adalah dokumen kamera multimedia high-definition dengan perbesaran optikal 20x dan resolusi 1080p / UXGA akan memberikan gambar jernih dan teks yang jelas setiap saat.</span></h5>\n', '', '', ''),
(31, 27, 1, 'TOPEX TBL 150T', '<h5>\n	<span style="font-size:14px;">Professional Microscope</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Various observation available by selecting the objectives according to the requirements.</span></h5>\n', '<h5>\n	<span style="font-size: 14px;">Convinient inward quadruple objectives</span></h5>\n<h5>\n	<span style="font-size:14px;">Eye angle and inside width adjustment head attached</span></h5>\n<h5>\n	<span style="font-size:14px;">Coarse / fine integration</span></h5>\n<h5>\n	<span style="font-size:14px;">Coaxial adjusting mechanical stage</span></h5>\n<h5>\n	<span style="font-size:14px;">Illumination level adjustable</span></h5>\n', '<h5>\n	&nbsp;</h5>\n<h5>\n	<span style="font-size:14px;">Head Trinocular head, 360 rotating head, 30 slope, width adjustment 55-75mm</span></h5>\n<h5>\n	<span style="font-size:14px;">Total Manification 10x - 1500x</span></h5>\n<h5>\n	<span style="font-size:14px;">Eyepieces WF 10X, WF 15X (each one pair)</span></h5>\n<h5>\n	<span style="font-size:14px;">Objective Arc 4x, 10X S40X, S100X Oil</span></h5>\n<h5>\n	<span style="font-size:14px;">Nosepiece inward quadruple nosepiece</span></h5>\n<h5>\n	<span style="font-size:14px;">Mechanical Stage Stage size 160 x 140mm, M/S moving distance 70 x 50mm</span></h5>\n<h5>\n	<span style="font-size:14px;">Condenser Abbe condenser (N.A. 1.25) with Iris, filter holder</span></h5>\n<h5>\n	<span style="font-size:14px;">Ilumintation 6V / 15W halogen lamp</span></h5>\n<h5>\n	<span style="font-size:14px;">Power SOurce AC 220V / 60Hz</span></h5>\n<h5>\n	<span style="font-size:14px;">filter (blue, green, gray each one)</span></h5>\n<h5>\n	<span style="font-size:14px;">one spare halogen lamp</span></h5>\n<h5>\n	<span style="font-size:14px;">Camera adapter</span></h5>\n<h5>\n	<span style="font-size:14px;">Photo lens (S2.5X, S4X, S6.3X)</span></h5>\n<h5>\n	<span style="font-size:14px;">CCD camera adapter</span></h5>\n'),
(32, 27, 2, 'TOPEX TBL 150T', '<h5>\n	<span style="font-size:14px;">Mikroskop Profesional</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Berbagai pengamatan tersedia dengan memilih tujuan yang sesuai dengan kebutuhan.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Kepala trinocular, dapat berputar 360, 30 kemiringan, penyesuaian lebar 55-75mm&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Jumlah Manification 10x - 1500X&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Eyepieces WF 10X, 15X WF (masing-masing satu pasang)&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Tujuan Arc 4x, 10X S40X, S100X Oil&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Nosepiece nosepiece ke dalam quadruple&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Tahap mekanik Tahap ukuran 160 x 140mm, M / S bergerak jarak 70 x 50mm&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Kondensor Abbe kondensor (NA 1,25) dengan Iris, penahan filter&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Ilumintation 6V / 15W lampu halogen&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Sumber daya AC 220V / 60Hz&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Filter (biru, hijau, abu-abu masing-masing)&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">satu lampu halogen cadang&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">adaptor kamera&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Lensa Foto (S2.5X, S4X, S6.3X)&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Adaptor kamera CCD</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Head Trinocular head, 360 rotating head, 30 slope, width adjustment 55-75mm</span></h5>\n<h5>\n	<span style="font-size:14px;">Total Manification 10x - 1500x</span></h5>\n<h5>\n	<span style="font-size:14px;">Eyepieces WF 10X, WF 15X (each one pair)</span></h5>\n<h5>\n	<span style="font-size:14px;">Objective Arc 4x, 10X S40X, S100X Oil</span></h5>\n<h5>\n	<span style="font-size:14px;">Nosepiece inward quadruple nosepiece</span></h5>\n<h5>\n	<span style="font-size:14px;">Mechanical Stage Stage size 160 x 140mm, M/S moving distance 70 x 50mm</span></h5>\n<h5>\n	<span style="font-size:14px;">Condenser Abbe condenser (N.A. 1.25) with Iris, filter holder</span></h5>\n<h5>\n	<span style="font-size:14px;">Ilumintation 6V / 15W halogen lamp</span></h5>\n<h5>\n	<span style="font-size:14px;">Power SOurce AC 220V / 60Hz</span></h5>\n<h5>\n	<span style="font-size:14px;">filter (blue, green, gray each one)</span></h5>\n<h5>\n	<span style="font-size:14px;">one spare halogen lamp</span></h5>\n<h5>\n	<span style="font-size:14px;">Camera adapter</span></h5>\n<h5>\n	<span style="font-size:14px;">Photo lens (S2.5X, S4X, S6.3X)</span></h5>\n<h5>\n	<span style="font-size:14px;">CCD camera adapter</span></h5>\n'),
(33, 28, 1, 'TOPEX TMS-700', '<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Microscope Monitor System</span></u></span></h5>\n', '<h5>\n	<span style="font-size:14px;">The sample of the microscope can be observed through the CCD and color monitor and the data can be preserved permanently in the video for repeated education which is the optical meeting with electronics.</span></h5>\n', '<div id="cke_pastebin">\n	<h5>\n		<span style="font-size:14px;">Magnification 40X - 600X (on the basis of eye contact)</span></h5>\n	<h5>\n		<span style="font-size:14px;">CCD color camera</span></h5>\n</div>\n', '<h5>\n	<span style="font-size:14px;">TMS-700</span></h5>\n<h5>\n	<span style="font-size:14px;">Head polarizing + biological teaching head, 360 rotateable, 45 slope</span></h5>\n<h5>\n	<span style="font-size:14px;">Magnification 40X - 600X (on the basis of eye contact)</span></h5>\n<h5>\n	<span style="font-size:14px;">Power source 220V, 20W</span></h5>\n<h5>\n	<span style="font-size:14px;">Polarized, analyser</span></h5>\n<h5>\n	<span style="font-size:14px;">first order red 4.4</span></h5>\n<h5>\n	<span style="font-size:14px;">retarder 1/4</span></h5>\n<h5>\n	<span style="font-size:14px;">Buttleland lens adopted</span></h5>\n<h5>\n	<span style="font-size:14px;">CCD color camera</span></h5>\n<h5>\n	<span style="font-size:14px;">C / CS adapter</span></h5>\n');
INSERT INTO `tbl_product_content` (`id`, `product_id`, `lang_id`, `subject`, `text`, `overview`, `features`, `specification`) VALUES
(34, 28, 2, 'TOPEX TMS-700', '<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Mikroskop Polarize</span></u></span></h5>\n<h5>\n	<span style="font-size:14px;">Sistem Mikroskop Bermonitor</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Hasil pengamatan mikroskop dapat diobservasi melalui CCD dan monitor berwarna. Data dapat disimpan secara permanen dalam bentuk video dan diputar berulang kali dalam sesi pengajaran yang mana adalah hasil ketika perangkat optik dilengkapi perangkat elektronik.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Perbesaran 40X - 600X</span></h5>\n<h5>\n	<span style="font-size:14px;">Menggunakan kamera CCD color</span></h5>\n', '<h5>\n	<span style="font-size:14px;">TMS-700</span></h5>\n<h5>\n	<span style="font-size:14px;">Head polarizing + biological teaching head, 360 rotateable, 45 slope</span></h5>\n<h5>\n	<span style="font-size:14px;">Magnification 40X - 600X (on the basis of eye contact)</span></h5>\n<h5>\n	<span style="font-size:14px;">Power source 220V, 20W</span></h5>\n<h5>\n	<span style="font-size:14px;">Polarized, analyser</span></h5>\n<h5>\n	<span style="font-size:14px;">first order red 4.4</span></h5>\n<h5>\n	<span style="font-size:14px;">retarder 1/4</span></h5>\n<h5>\n	<span style="font-size:14px;">Buttleland lens adopted</span></h5>\n<h5>\n	<span style="font-size:14px;">CCD color camera</span></h5>\n<h5>\n	<span style="font-size:14px;">C / CS adapter</span></h5>\n'),
(35, 29, 1, 'BXB EDS', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;"><u>BXB FCS</u></span> is a digital audio conference system which design to empower your conference activity. With <span style="color:#ff8c00;"><u>simple</u></span> and<span style="color:#ff8c00;"><u> elegant design</u></span> which gives your clear &amp; loud voice to create a great session of conferencing. The installation of this device is really simple &amp; clean with single cable only for connection. It ensure simple operation for all of conference member to do the conference in confident and simple way.</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n', '<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Clear and Pure Sound Quality</span></span></h5>\n<h5>\n	<span style="font-size:14px;">It possess good quality and diminutive feedback. When turning on the microphone, hidden - speaker will be silent to prevent acoustic feedback.</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Simple To Use</span></span></h5>\n<h5>\n	<span style="font-size:14px;">We provide you several conference management modes, and you just need to select which mode is suitable for your conference. In addition, you can change the modes anytime you want during the conferencing and the settings can be saved immediately. It is a high efficiency device, it&#39;s worth of trying.</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Elegant and Decent Design</span></span></h5>\n<h5>\n	<span style="font-size:14px;">EDC 1000 series is a whole new design microphone model. The concept of the streamlined roof shape &amp; butterfly logo is from the Chinese ancient traditions which mean&quot; Happiness &quot;. Therefore, every product from BXB has its own story.</span></h5>\n<h5>\n	&nbsp;</h5>\n<h5>\n	<span style="font-size:14px;">The push button is adopted with back - light illumination.</span></h5>\n<h5>\n	<span style="font-size:14px;">Illuminated Red Ring of Light.</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">ISO 9001 Certified Factory &amp; Quality Guarantee</span></span></h5>\n<h5>\n	<span style="font-size:14px;">Each products has been tested and certified by BXB Electronics co. based on ISO 9001 regulations.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">- Connection up to 10 chairman unit &amp; 999 delegate unit, free position configuration.</span></h5>\n<h5>\n	<span style="font-size:14px;">- 5 mode conference system</span></h5>\n<h5>\n	<span style="font-size:14px;">- Delegate microphone unit can be activate up to 9 unit simultaneously</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in sound emision to avoid noise and echo</span></h5>\n<h5>\n	<span style="font-size:14px;">- Auto mic shut up, microphone which not in use for some second will be turned off automatically.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Mic-in 4 unit</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in amplifier</span></h5>\n<h5>\n	<span style="font-size:14px;">- Auto detect connection</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Main Control Unit EDS 1050</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Frequency response</span> : 100Hz - 16Khz</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Line In</span> : -4dB ~ +6dB &gt; 10 KOhm (Balanced)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Line Out</span> : -4dB ~ +12dB &gt; 200 KOhm (Balanced)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Sensitivity</span> : -60dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">THD</span> : &lt; 0.5%</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">S/N Ratio</span> : &gt;90dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Conference microphone connection</span> : D type 9P express port x 3 sets</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Mic Input</span> : 4 set x 600Q/6mV/-22dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Line Input</span> : 4 set x 20KQ/300mV/-10dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Line Output</span> : 2 sets</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Amplifier</span> : 40W (8Q) x 2</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Volume Indicators</span> : 5 LEDs</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Power</span> : AC110/220 50/60Hz</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Dimension (HWD)</span> : 100x430x230 mm</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="font-size:14px;">Chairman Unit EDS 1011 &amp; Delegate Unit EDS 1012</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Frequency response</span> : 100 Hz - 16KHz</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Sensitivity</span> : &gt;-50dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Total Harmonic</span> : &lt;0.1%</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Distortion</span> : &gt;70dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">S/N Ratio</span> : DC 12V - 18V</span></h5>\n'),
(36, 29, 2, 'BXB EDS', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;"><u>Sistim EDS</u></span> adalah audio conference digital yang dirancang khusus untuk membantu anda melakukan aktivitas konferensi dengan rekan kerja anda atau tamu penting, dimana alat ini dirancang dengan kualitas sangat tinggi untuk mendukung acara konferensi bergengsi dan berkelas, sehingga anda dapat mengandalkan audio conference ini.&nbsp;</span></h5>\n', '<h5>\n	<span style="font-size: 14px;"><span style="color:#ff8c00;">Sistim EDS</span> adalah audio conference digital yang dirancang khusus untuk membantu anda melakukan aktivitas konferensi dengan rekan kerja anda atau tamu penting, dimana alat ini dirancang dengan kualitas sangat tinggi untuk mendukung acara konferensi bergengsi dan berkelas, sehingga anda dapat mengandalkan audio conference ini. Serta didukung dengan kualitas suara yang jenih, speaker kualitas tinggi yang dibuat sedemikian rupa sehingga keindahan alat sesuai dengan desain dan performanya, yang terpenting audio conference ini mudah digunakan oleh orang awam sekalipun dan instalasi kabel yang sangat mudah serta rapih, tidak seperti audio conference lainnya.</span></h5>\n<h5>\n	<span style="font-size: 14px;">Audio conference EDS menjamin keandalan dan kemudahan dalam persiapan konferensi, pengontrolan, dan partisipasi peserta sehingga semuanya berjalan dengan lancar tanpa harus merasa kuatir akan terjadi masalah dalam penggunaan atau hal2 lain.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">- Kapasitas sampai dengan 10 chairman unit &amp; 999 delegate unit bebas pengaturan posisi.</span></h5>\n<h5>\n	<span style="font-size:14px;">- 5 modus conference sistem</span></h5>\n<h5>\n	<span style="font-size:14px;">- Mikropon delegate dapat diaktifkan bersamaan hingga 9 delegate unit</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in sound emision yg mencegah noise dan echo</span></h5>\n<h5>\n	<span style="font-size:14px;">- Auto mic shut up, mikropon akan otomatis mati apabila tidak terpakai dalam hitungan beberapa detik.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Mic-in 4 unit</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in amplifier</span></h5>\n<h5>\n	<span style="font-size:14px;">- Auto detect connection</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Main Control Unit <span style="color:#ff8c00;">EDS 1050</span></span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Frequency response</span> : 100Hz - 16Khz</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Line In</span> : -4dB ~ +6dB &gt; 10 KOhm (Balanced)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Line Out</span> : -4dB ~ +12dB &gt; 200 KOhm (Balanced)</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Sensitivity</span> : -60dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">THD</span> : &lt; 0.5%</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">S/N Ratio</span> : &gt;90dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Conference microphone connection</span> : D type 9P express port x 3 sets</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Mic Input</span> : 4 set x 600Q/6mV/-22dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Line Input</span> : 4 set x 20KQ/300mV/-10dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Line Output</span> : 2 sets</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Amplifier</span> : 40W (8Q) x 2</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Volume Indicators </span>: 5 LEDs</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Power</span> : AC110/220 50/60Hz</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Dimension (HWD)</span> : 100x430x230 mm</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="font-size:14px;">Chairman Unit EDS 1011 &amp; Delegate Unit EDS 1012</span></h5>\n<h5>\n	<span style="font-size:14px;">Frequency response : 100 Hz - 16KHz</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Sensitivity</span> : &gt;-50dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Total Harmonic</span> : &lt;0.1%</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Distortion</span> : &gt;70dB</span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">S/N Ratio</span> : DC 12V - 18V</span></h5>\n'),
(37, 30, 1, 'BXB FCS Series', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">BXB FCS</span> is a digital audio conference system which design to empower your conference activity. With simple and elegant design which gives your clear &amp; loud voice to create a great session of conferencing.</span></h5>\n', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">BXB FCS</span> is a digital audio conference system which design to empower your conference activity. With <span style="color:#ff8c00;"><u>simple</u></span> and <span style="color:#ff8c00;">e<u>legant design</u></span> which gives your clear &amp; loud voice to create a great session of conferencing. The installation of this device is really simple &amp; clean with single cable only for connection. It ensure simple operation for all of conference member to do the conference in confident and simple way.</span></h5>\n', '<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Clear and Pure Sound Quality</span></span></h5>\n<h5>\n	<span style="font-size:14px;">It possess good quality and diminutive feedback. When turn on the microphone, hidden - speaker will be silent to prevent acoustic feedback.</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Powerful Integration Capability</span></span></h5>\n<h5>\n	<span style="font-size:14px;">It can be easily integrated with multi - media devices, such as telephone conferencing, video conferencing, web - video conferencing and etc.</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="font-size:14px;">It provides User friendly Graphical control software, with this software , you can easily manage or control system settings through Internet.</span></h5>\n<h5>\n	<span style="font-size:14px;">It provides comprehensive interface for AV control system integration, it also can be integrated with BXB Graphical control software or AMX/ Crestron system.</span></h5>\n<h5>\n	<span style="font-size:14px;">It controls 16 sets High Speed Domes which can be executed Images/ Voice Auto - Tracing while connected with video conference system.</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Elegant and Innovative Design</span></span></h5>\n<h5>\n	<span style="font-size:14px;">FCS 6000/ 3000 series is a an innovative design microphone model. The streamlined style is from the concept of roadster. It means fast, cool and attractive. It will make your conferencing be different.</span></h5>\n<h5>\n	&nbsp;</h5>\n<h5>\n	<span style="font-size:14px;">The push button features with a backlight illumination.</span></h5>\n<h5>\n	<span style="font-size:14px;">Illuminated Red Ring of Light.</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">ISO 9001 Certified Factory &amp; Quality Guarantee</span></span></h5>\n<h5>\n	<span style="font-size:14px;">Each products has been tested and certified by BXB Electronics co. based on ISO 9001 certificates.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Main Control Unit FCS 6051</span></h5>\n<h5>\n	<span style="font-size:14px;">Have 3 output which each output can be connected to 25 unit.</span></h5>\n<h5>\n	<span style="font-size:14px;">Able to control 10 chairman unit and 999 delegate unit (with extended power supply unit).</span></h5>\n<h5>\n	<span style="font-size:14px;">Have LCD monitor display (4 lines, 20 characters/line) for easy set-up and configuration.</span></h5>\n<h5>\n	<span style="font-size:14px;">Automatic Test Function on power up, red ring light will flash repeatedly if the line disconnected.</span></h5>\n<h5>\n	<span style="font-size:14px;">Chairman Unit FCS 6015</span></h5>\n<h5>\n	<span style="font-size:14px;">Delegate Unit FCS 6016</span></h5>\n'),
(38, 30, 2, 'BXB FCS Series', '<h5>\n	<span style="font-size:14px;">Full Function Conference System</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Sistim FCS adalah audio conference digital yang dirancang khusus untuk membantu anda melakukan aktivitas konferensi dengan rekan kerja anda atau tamu penting, dimana alat ini dirancang dengan kualitas sangat tinggi untuk mendukung acara konferensi bergengsi dan berkelas, sehingga anda dapat mengandalkan audio conference ini. Serta didukung dengan kualitas suara yang jenih, speaker kualitas tinggi yang dibuat sedemikian rupa sehingga keindahan alat sesuai dengan desain dan performanya, yang terpenting audio conference ini mudah digunakan oleh orang awam sekalipun dan instalasi kabel yang sangat mudah serta rapih, tidak seperti audio conference lainnya.</span></h5>\n<h5>\n	<span style="font-size:14px;">Audio conference FCS menjamin keandalan dan kemudahan dalam persiapan konferensi, pengontrolan, dan partisipasi peserta sehingga semuanya berjalan dengan lancar tanpa harus merasa kuatir akan terjadi masalah dalam penggunaan atau hal2 lain.</span></h5>\n', '', ''),
(39, 31, 1, 'BXB WMP-2100', '<h5>\n	<span style="font-size:14px;">DPS Main Controller is the main unit to connect all of equipment with one cable installation system which makes high quality audio transmission along with excellent management system. It can be applied on places such as Department store, Mall, Shopping Arcade, Office Buildings, Schools, Universities, Airport, Train stations, Bus stations, Factory, Entertainment sites, Theater, Sport stadium, Military, Hospitals, Jails, etc.</span></h5>\n', '<h5>\n	<span style="font-size: 14px;">DPS Main Controller is the main unit to connect all of equipment with one cable installation system which makes high quality audio transmission along with excellent management system. It can be applied on places such as Department store, Mall, Shopping Arcade, Office Buildings, Schools, Universities, Airport, Train stations, Bus stations, Factory, Entertainment sites, Theater, Sport stadium, Military, Hospitals, Jails, etc.</span></h5>\n<div id="cke_pastebin">\n	&nbsp;</div>\n<h5>\n	<span style="font-size:14px;">BXB WMP-2100 Equipments</span></h5>\n<h5>\n	<span style="font-size:14px;">- Extension Power Supply</span></h5>\n<h5>\n	<span style="font-size:14px;">- Control cabling</span></h5>\n<h5>\n	<span style="font-size:14px;">- Remote Decoder</span></h5>\n<h5>\n	<span style="font-size:14px;">- Speaker Volume Control</span></h5>\n<h5>\n	<span style="font-size:14px;">- Power Amplifier</span></h5>\n<h5>\n	<span style="font-size:14px;">- Amplifier Speaker</span></h5>\n<h5>\n	<span style="font-size:14px;">- Waterproof Speaker</span></h5>\n<h5>\n	<span style="font-size:14px;">- Desk Microphone</span></h5>\n<h5>\n	<span style="font-size:14px;">- Personal Computer (PC)</span></h5>', '<h5>\n	<span style="font-size:14px;">- It is adopted with Digital Two-Way Transmission system. With One Single Cable connection, it not only saves the installation time, but also makes the installing easier and repairing quicker.</span></h5>\n<h5>\n	<span style="font-size:14px;">- It has 64 single area keys, 8 group keys, 1 ALL CALL key and 1 CLEAR key. There is space on the top of each key for users to make notes.</span></h5>\n<h5>\n	<span style="font-size:14px;">- It is equipped with 8CH Input Mixer: 4 Mics Input, 4 Aux Input, 4 Sound Input &amp; Separate/ Master Volume Controls&amp; 1 Group of Base &amp; Tremble Volume Controls.</span></h5>\n<h5>\n	<span style="font-size:14px;">- 3 Colors LED Status Displays.</span></h5>\n<h5>\n	<span style="font-size:14px;">- System Self - detecting &amp; Records scanning functions.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Provide RS - 232 terminal connecting with graphical main controller.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Frequency response : 50Hz ~ 20 kHz</span></h5>\n<h5>\n	<span style="font-size:14px;">RF OUT : 12 VPP (circuit memorize to affirm)</span></h5>\n<h5>\n	<span style="font-size:14px;">Sensitivity : -60dB</span></h5>\n<h5>\n	<span style="font-size:14px;">Total harmonic distortion : &lt;=0.5%</span></h5>\n<h5>\n	<span style="font-size:14px;">S/N : MIC &gt; 60dB, AUX &gt; 70dB</span></h5>\n<h5>\n	<span style="font-size:14px;">Transmission method : digital signal</span></h5>\n<h5>\n	<span style="font-size:14px;">Transmission rate : &gt; 9600/bit</span></h5>\n<h5>\n	<span style="font-size:14px;">MIC INPUT : 4 sets 600 Ohm / 6mV / -22dB</span></h5>\n<h5>\n	<span style="font-size:14px;">LINE IN : 4 sets 22 kOhm / 300mV / -10dB</span></h5>\n<h5>\n	<span style="font-size:14px;">LINE OUT : 3 sets 22 kOhm / 300mV / -22dB</span></h5>\n<h5>\n	<span style="font-size:14px;">Power consumption : 20A</span></h5>\n<h5>\n	<span style="font-size:14px;">Power : AC110/220, 50/60Hz, Power LED light</span></h5>\n<h5>\n	<span style="font-size:14px;">Dimension (HWD) : 465 x 30 x 130 (mm)</span></h5>\n<h5>\n	<span style="font-size:14px;">Weight : 10kg</span></h5>\n<h5>\n	<span style="font-size:14px;">Installation kit : 19&quot; bracket mounting kit</span></h5>\n<h5>\n	<span style="font-size:14px;">Surface : Ivory white coating, against rusty</span></h5>\n'),
(40, 31, 2, 'BXB WMP-2100', '<h5>\n	<span style="font-size:14px;">DPS Main Controller adalah perangkat yang menghubungkan seluruh perlengkapan dengan instalasi satu kabel sehingga menghasilkan tranmisi suara berkualitas tinggi dan sistem manajemen yang sangat baik. Dapat diaplikasikan di beberapa tempat seperti: Departemen store, Mall, Pusat pertokoan, Gedung perkantoran, Sekolah, Universitas, Bandara, Stasiun kereta, Terminal bus, Industri, Tempat wisata, Bioskop, Stadion Olah raga, Militer, Rumah sakit, Penjara, dan lain sebagainya.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">DPS Main Controller adalah perangkat yang menghubungkan seluruh perlengkapan dengan instalasi satu kabel sehingga menghasilkan tranmisi suara berkualitas tinggi dan sistem manajemen yang sangat baik. Dapat diaplikasikan di beberapa tempat seperti: Departemen store, Mall, Pusat pertokoan, Gedung perkantoran, Sekolah, Universitas, Bandara, Stasiun kereta, Terminal bus, Industri, Tempat wisata, Bioskop, Stadion Olah raga, Militer, Rumah sakit, Penjara, dan lain sebagainya.</span></h5>\n<h5>\n	<span style="font-size:14px;">Perangkat pendukung BXB WMP-2100</span></h5>\n<h5>\n	<span style="font-size:14px;">- Extension Power Supply</span></h5>\n<h5>\n	<span style="font-size:14px;">- Control cabling</span></h5>\n<h5>\n	<span style="font-size:14px;">- Remote Decoder</span></h5>\n<h5>\n	<span style="font-size:14px;">- Speaker Volume Control</span></h5>\n<h5>\n	<span style="font-size:14px;">- Power Amplifier</span></h5>\n<h5>\n	<span style="font-size:14px;">- Amplifier Speaker</span></h5>\n<h5>\n	<span style="font-size:14px;">- Waterproof Speaker</span></h5>\n<h5>\n	<span style="font-size:14px;">- Desk Microphone</span></h5>\n<h5>\n	&nbsp;</h5>\n<h5>\n	<span style="font-size:14px;">- Personal Computer (PC)</span></h5>\n', '', ''),
(41, 32, 1, 'Chiayo Challenger 1000', '<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Modulized Wireless Portable Sound System</span></u></span></h5>\n<h5>\n	<span style="font-size:14px;">It is suitable to use in Indonesia where the power supply voltage fluctuates often high, because the system is equipped with a very wide voltage range of 90-264 volts AC, so the unit is guaranteed not easily damaged if used on low voltage (eg 140V, 150V) and high voltage (eg 240V, 250V).</span></h5>\n', '<h5>\n	<span style="font-size:14px;">The new type Challenger 1000 has been equipped with additional built-in amplifiers Class D 100 Watt, multimedia, multi-arena, designed for use both inside and outside the room, the capacity of the high quality sound to the room to about 800m2 (900 audience), modular design making it easy and inexpensive maintenance costs, very practical and easy to transport places because it has a pull which can be stored inside the unit as well as a built-in wheels with a powerful, full-range speaker types (for low frequencies up to high) large size (10 inch / 4 ohms) and the frequency response of 50Hz - 20kHz, continuous operating capacity of up to 8 hours. Quality and reliability is assured because of manufacturer certified ISO 9001 international quality. Can be equipped with a tripod, and a water-resistant material fitted cover.</span></h5>\n', '<h5>\n	<span style="font-size: 14px;">Master &amp; individual volume control.</span></h5>\n<h5>\n	<span style="font-size:14px;">Equipped with 2 mic, wireless clip-on &amp; wireless handheld, 105 meter range, both using AA size batteries.</span></h5>\n<h5>\n	<span style="font-size:14px;">Mic batteries (up to 4 pcs) could be recharge on the unit.</span></h5>\n<h5>\n	<span style="font-size:14px;">Mic volume could be set to mute the music (voice priority).</span></h5>\n<h5>\n	<span style="font-size:14px;">Special voice for ambulance, police, and fire figters.</span></h5>\n<h5>\n	<span style="font-size:14px;">CD/MP3 Player (anti shock), built-in USB port &amp; remote control, also available DVD/VCD/MP3/MP4/CD Player (remote control access front &amp; back).</span></h5>\n<h5>\n	<span style="font-size:14px;">Cassete tape recorder (pitch control system).</span></h5>\n<h5>\n	<span style="font-size:14px;">Echo (volume control available).</span></h5>\n<h5>\n	<span style="font-size:14px;">Inputs : line in &amp; 2 wired mic.</span></h5>\n<h5>\n	<span style="font-size:14px;">Outputs : external speaker, mix out, video out with video cable 2.75 meter.</span></h5>\n<h5>\n	<span style="font-size:14px;">Main battery could be recharge (6 hours only).</span></h5>\n<h5>\n	<span style="font-size:14px;">Unit casing made of Alumunium (better than polypropyline) which waterproof.</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Optional:</span></u></span></h5>\n<h5>\n	<span style="font-size:14px;">DVD/VCD/MP3/MP4/CD Player</span></h5>\n<h5>\n	<span style="font-size:14px;">Receiver RF (16 channel, pilihan channel sistim LED)</span></h5>\n<h5>\n	<span style="font-size:14px;">Sisa isi batere ditayangkan sistim LED</span></h5>\n<h5>\n	<span style="font-size:14px;">Built-in tempat penyimpanan mic handheld, mikropon clip-on, kabel power dan kabel video.</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Output power : 100 W / 4 ohm / 900 audience</span></h5>\n<h5>\n	<span style="font-size:14px;">Speaker system : 10&quot; 2-way speaker &amp; crossover</span></h5>\n<h5>\n	<span style="font-size:14px;">T.H.D. : &lt; 0.5%</span></h5>\n<h5>\n	<span style="font-size:14px;">Operasional time : 5-6 hours (music), 8 hours (mic)</span></h5>\n<h5>\n	<span style="font-size:14px;">Recharging time : 6 hours</span></h5>\n<h5>\n	<span style="font-size:14px;">Dimension (mm) : 500(H) x 350(W) x 300(D)</span></h5>\n<h5>\n	<span style="font-size:14px;">Weight (kg) : 16.9 kg</span></h5>\n<h5>\n	<span style="font-size:14px;">Frequency Response : 50Hz - 20kHz +-3dB</span></h5>\n<h5>\n	<span style="font-size:14px;">Frequency Range : UHF (600 - 980 MHz)</span></h5>\n<h5>\n	<span style="font-size:14px;">Programmed Freq. : Fixed (optional 16 channel)</span></h5>\n'),
(42, 32, 2, 'Chiayo Challenger 1000', '<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Modulized Wireless Portable Sound System</span></u></span></h5>\n<h5>\n	<span style="font-size:14px;">Sangat cocok digunakan di Indonesia dimana tegangan listrik sering berfluktuasi tinggi, karena dilengkapi dengan sistim rentang voltase yang sangat luas dari 90 - 264 Volt AC, sehingga alat sangat terjamin tidak mudah rusak kalau digunakan pada voltase rendah (misalnya pada 140V, 150V) dan tinggi (misalnya pada 240V, 250V).</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Tipe baru Challenger 1000 telah dilengkapi dengan fitur tambahan amplifier built-in kelas D 100 Watt, multimedia, multi-arena, dirancang untuk digunakan baik di dalam maupun di luar ruangan, kapasitas suara kualitas tinggi untuk ruangan hingga sekitar 800m2 (900 pengunjung), rancangan moduler sehingga mudah dan murah biaya perawatannya, sangat praktis dan mudah untuk dipindah tempat karena dilengkapi tarikan, dapat disimpan di dalam alat serta dengan roda built-in yang kuat, speaker jenis full-range (untuk frekuensi rendah hingga tinggi) ukurang besar (10 inch / 4 ohm) serta frekwensi respon 50Hz - 20kHz, kapasitas operasi hingga terus menerus 8 jam. Kualitas dan keandalan terjamin karena dari produsen yang bersertifikasi mutu internasional ISO 9001. Dapat dilengkapi tripod, dan dilengkapi sarung bahan kedap air.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Master &amp; individual volume kontrol</span></h5>\n<h5>\n	<span style="font-size:14px;">Dilengkapi 2 mic. clip-on dan handheld (nirkabel), jangkauan jarak hingga 105 meter, menggunakan batere ukuran AA pada kedua mic ini.</span></h5>\n<h5>\n	<span style="font-size:14px;">Batere mic (hingga 4 buah) dapat diisi ulang pada unit.</span></h5>\n<h5>\n	<span style="font-size:14px;">Suara mic dapat disetel meredam suara musik (voice priority).</span></h5>\n<h5>\n	<span style="font-size:14px;">Fitur istimewa suara sirine untuk pilihan : ambulan, polisi, dan kebakaran.</span></h5>\n<h5>\n	<span style="font-size:14px;">CD/MP3 Player (rancangan anti getar), built-in USB port &amp; remote kontrol, dapat pula dilengkapi DVD/VCD/MP3/MP4/CD Player (akses remote kontrol depan belakang).</span></h5>\n<h5>\n	<span style="font-size:14px;">Kaset tape rekorder (sistem pitch kontrol).</span></h5>\n<h5>\n	<span style="font-size:14px;">Echo (volume dapat diatur).</span></h5>\n<h5>\n	<span style="font-size:14px;">Terminal-terminal input: line in &amp; 2 wired mic.</span></h5>\n<h5>\n	<span style="font-size:14px;">Terminal-terminal output: external speaker, mix out, video out dengan kabel video 2.75 meter.</span></h5>\n<h5>\n	<span style="font-size:14px;">Batere utama unit dapat diisi ulang (cukup 6 jam).</span></h5>\n<h5>\n	<span style="font-size:14px;">Casing unit dari bahan alumunium (mutu lebih baik dari bahan polypropyline) yang kedap air.</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Optional:</span></u></span></h5>\n<h5>\n	<span style="font-size:14px;">DVD/VCD/MP3/MP4/CD Player</span></h5>\n<h5>\n	<span style="font-size:14px;">Receiver RF (16 channel, pilihan channel sistim LED)</span></h5>\n<h5>\n	<span style="font-size:14px;">Sisa isi batere ditayangkan sistim LED</span></h5>\n<h5>\n	<span style="font-size:14px;">Built-in tempat penyimpanan mic handheld, mikropon clip-on, kabel power dan kabel video.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Output power : 100 W / 4 ohm / 900 pengunjung</span></h5>\n<h5>\n	<span style="font-size:14px;">Speaker system : 10&quot; 2-way speaker &amp; crossover</span></h5>\n<h5>\n	<span style="font-size:14px;">T.H.D. : &lt; 0.5%</span></h5>\n<h5>\n	<span style="font-size:14px;">Kemampuan operasional : 5-6 jam (musik), 8 jam (mic)</span></h5>\n<h5>\n	<span style="font-size:14px;">waktu isi ulang batere : 6 jam</span></h5>\n<h5>\n	<span style="font-size:14px;">Dimension (mm) : 500(H) x 350(W) x 300(D)</span></h5>\n<h5>\n	<span style="font-size:14px;">Weight (kg) : 16.9 kg</span></h5>\n<h5>\n	<span style="font-size:14px;">Frequency Response : 50Hz - 20kHz +-3dB</span></h5>\n<h5>\n	<span style="font-size:14px;">Frequency Range : UHF (600 - 980 MHz)</span></h5>\n<h5>\n	<span style="font-size:14px;">Programmed Freq. : Fixed (optional 16 channel)</span></h5>\n'),
(43, 33, 1, 'Chiayo Stage Pro', '<h5>\n	<span style="font-size:14px;">Chiayo with the latest model release Stage Pro (modulized wireless Portable Sound Mixer Amplifier) is a very special product which equipped with modern connections (bluetooth), musical instrument inputs, digital inputs with super large capacity.&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">Stage Pro can be used in a very large event with a capacity of up to 900 audience such as seminars, meetings, worships, panel discussions, gymnastics, and others.</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n', '<h5>\n	<span style="font-size: 14px;">Chiayo with the latest model release Stage Pro (modulized wireless Portable Sound Mixer Amplifier) is a very special product which equipped with modern connections (bluetooth), musical instrument inputs, digital inputs with super large capacity.&nbsp;</span></h5>\n<h5>\n	<span style="font-size: 14px;">Stage Pro can be used in a very large event with a capacity of up to 900 audience such as seminars, meetings, worships, panel discussions, gymnastics, and others.</span></h5>\n', '<h5>\n	<span style="font-size: 14px;">Includes an Electronic&nbsp;</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Output power : 200W, 150W(RMS) 4O load (class-D)</span></h5>\n<h5>\n	<span style="font-size:14px;">Speaker system : 8&quot;LF + 1&quot;HF &amp; electronic crossover</span></h5>\n<h5>\n	<span style="font-size:14px;">Audio input : Mic in x2 (COMBO), Line in x2 (R / L, 3.5mm), Instrument in x2, Digital in (USB)</span></h5>\n<h5>\n	<span style="font-size:14px;">Audio output : Line out (R / L), Aux out, Active out</span></h5>\n<h5>\n	<span style="font-size:14px;">T.H.D. : &lt; 0.5%</span></h5>\n<h5>\n	<span style="font-size:14px;">Freq. response : 50Hz-20KHz&plusmn;3dB</span></h5>\n<h5>\n	<span style="font-size:14px;">Antenna : Built-in</span></h5>\n<h5>\n	<span style="font-size:14px;">Power supply : 100-240V AC / 30-32V DC, 4A</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="font-size:14px;">Battery type<span class="Apple-tab-span" style="white-space:pre"> </span>Lead-Acid <span class="Apple-tab-span" style="white-space:pre"> </span>Lithium</span></h5>\n<h5>\n	<span style="font-size:14px;">Battery spec <span class="Apple-tab-span" style="white-space:pre"> </span>12V, 5A <span class="Apple-tab-span" style="white-space:pre"> </span>29.4V, 7.8A</span></h5>\n<h5>\n	<span style="font-size:14px;">Battery Q&#39;ty <span class="Apple-tab-span" style="white-space:pre"> </span>2 <span class="Apple-tab-span" style="white-space:pre"> </span>1</span></h5>\n<h5>\n	<span style="font-size:14px;">Operating time <span class="Apple-tab-span" style="white-space:pre"> </span>5-6 hrs in music, &gt;10 hrs in speech <span class="Apple-tab-span" style="white-space:pre"> </span>8-10hrs in music, &gt;12 hrs in speech</span></h5>\n<h5>\n	<span style="font-size:14px;">Charging time <span class="Apple-tab-span" style="white-space:pre"> </span>about 6 hrs <span class="Apple-tab-span" style="white-space:pre"> </span>about 8hrs</span></h5>\n<h5>\n	<span style="font-size:14px;">Weight (kg) : <span class="Apple-tab-span" style="white-space:pre"> </span>12.5 <span class="Apple-tab-span" style="white-space:pre"> </span>9.5</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="font-size:14px;">Dimension (mm) : 424(H) x 290(W) x 250(D)</span></h5>\n<h5>\n	<span style="font-size:14px;">Receiver module : SDR-5116M / 5100M IrDA</span></h5>\n<h5>\n	<span style="font-size:14px;">Transmitter module : RP-5016M</span></h5>\n<h5>\n	<span style="font-size:14px;">MP3 module : DPR-500M, DP-500M</span></h5>\n<h5>\n	<span style="font-size:14px;">Bluetooth module : BT-500M</span></h5>\n<h5>\n	<span style="font-size:14px;">Patent : Taiwan, China</span></h5>\n<h5>\n	<span style="font-size:14px;">Approval : RoHS</span></h5>\n'),
(44, 33, 2, 'Chiayo Stage Pro', '<h5>\n	<span style="font-size:14px;">Modulized Wireless Portable Mixer Amplifier</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Chiayo dengan keluaran model terbaru yaitu Stage Pro (modulized wireless Portable Mixer Sound Amplifier) sangat istimewa karena sudah dilengkapi dengan koneksi modern (bluetooth), input instrument musik, input digital dengan kapasitas yang super besar.</span></h5>\n<h5>\n	<span style="font-size:14px;">Stage Pro dapat digunakan dalam acara sangat besar dengan kapasitas hingga 900 peserta seperti seminar, rapat, kebaktian, diskusi panel, senam, dan lain-lain.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">- Menggunakan crossover aktif, dan power amplifier kelas D digital, total power output 150 Watt (RMS) 100W ke driver LF dan 50W untuk HF. Kapasitas hingga 900 orang.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Menggunakan 2 power mode, batere isi ulang &amp; DC Jack</span></h5>\n<h5>\n	<span style="font-size:14px;">- Design istimewa untuk penyimpanan batere isi ulang sehingga memudahkan untuk penggantian</span></h5>\n<h5>\n	<span style="font-size:14px;">- Body terbuat dari bahan kedap air dan tahan benturan (polypropyline)</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in MP3 player USB port, SD Card dengan remote kontrol.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in bluetooth receiver modul dapat menghubungkan koneksi bluetooth dengan aneka player (HP / Laptop)</span></h5>\n<h5>\n	<span style="font-size:14px;">- Menggunakan 2 modul penerima mikropon (handheld &amp; clip-on) dengan rancangan moduler menggunakan frekuensi UHF, 16 channel pilihan frekwensi dengan indikator channel LED.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi 2 mikropon wireless (handheld &amp; clip-on) dengan frekuensi UHF, jangkauan pengoperasian hingga 10 meter.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in 6 indikator LED auto digital limiter untuk mencegah terjadinya distorsi.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi 3 bank equalizer BASS, MIDDLE, dan TREBLE.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi fungsi VOICE PRIORITY, otomatis meredam musik saat mikropon digunakan (switch).</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi fungsi LOUDNESS meningkatkan kinerja bass / treble (switch).</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi LINE OUT (RCA) untuk merekam audio eksternal.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi multiple LINE IN, jack 3.5mm dan RCA dengan volume kontrol (stereo).</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi INSTRUMENT IN dua jack 6.3mm untuk dihubungkan ke input instrumen (alat musik) dengan volume kontrol.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi 2 Mikropon IN 1, konektor jack combo (XLR / jack 6.3mm) untuk input mikropon kabel dengan individual volume kontrol.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi DIGITAL IN (USB port) menghubungkan sumber audio digital dari komputer secara langsung dengan kabel USB.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi pengontrolan BASS, TREBLE, dan REVERB untuk mikropon kabel.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi REVERB dengan ON/OFF untuk memberikan kontrol reverb mikropon kabel.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Dilengkapi AKTIF OUT (XLR) dan AUX OUT (jack 6.3mm) untuk speaker aktif eksternal.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in indikator 4 segmen LED untuk mengetahui kapasitas batere yang tersisa.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in tripod stand mount, unit dapat diletakkan di atas tripod</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Output power : 200W, 150W(RMS) 4O load (class-D)</span></h5>\n<h5>\n	<span style="font-size:14px;">Speaker system : 8&quot;LF + 1&quot;HF &amp; electronic crossover</span></h5>\n<h5>\n	<span style="font-size:14px;">Audio input : Mic in x2 (COMBO), Line in x2 (R / L, 3.5mm), Instrument in x2, Digital in (USB)</span></h5>\n<h5>\n	<span style="font-size:14px;">Audio output : Line out (R / L), Aux out, Active out</span></h5>\n<h5>\n	<span style="font-size:14px;">T.H.D. : &lt; 0.5%</span></h5>\n<h5>\n	<span style="font-size:14px;">Freq. response : 50Hz-20KHz&plusmn;3dB</span></h5>\n<h5>\n	<span style="font-size:14px;">Antenna : Built-in</span></h5>\n<h5>\n	<span style="font-size:14px;">Power supply : 100-240V AC / 30-32V DC, 4A</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="font-size:14px;">Battery type<span class="Apple-tab-span" style="white-space:pre"> </span>Lead-Acid <span class="Apple-tab-span" style="white-space:pre"> </span>Lithium</span></h5>\n<h5>\n	<span style="font-size:14px;">Battery spec <span class="Apple-tab-span" style="white-space:pre"> </span>12V, 5A <span class="Apple-tab-span" style="white-space:pre"> </span>29.4V, 7.8A</span></h5>\n<h5>\n	<span style="font-size:14px;">Battery Q&#39;ty <span class="Apple-tab-span" style="white-space:pre"> </span>2 <span class="Apple-tab-span" style="white-space:pre"> </span>1</span></h5>\n<h5>\n	<span style="font-size:14px;">Operating time <span class="Apple-tab-span" style="white-space:pre"> </span>5-6 hrs in music, &gt;10 hrs in speech <span class="Apple-tab-span" style="white-space:pre"> </span>8-10hrs in music, &gt;12 hrs in speech</span></h5>\n<h5>\n	<span style="font-size:14px;">Charging time <span class="Apple-tab-span" style="white-space:pre"> </span>about 6 hrs <span class="Apple-tab-span" style="white-space:pre"> </span>about 8hrs</span></h5>\n<h5>\n	<span style="font-size:14px;">Weight (kg) : <span class="Apple-tab-span" style="white-space:pre"> </span>12.5 <span class="Apple-tab-span" style="white-space:pre"> </span>9.5</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="font-size:14px;">Dimension (mm) : 424(H) x 290(W) x 250(D)</span></h5>\n<h5>\n	<span style="font-size:14px;">Receiver module : SDR-5116M / 5100M IrDA</span></h5>\n<h5>\n	<span style="font-size:14px;">Transmitter module : RP-5016M</span></h5>\n<h5>\n	<span style="font-size:14px;">MP3 module : DPR-500M, DP-500M</span></h5>\n<h5>\n	<span style="font-size:14px;">Bluetooth module : BT-500M</span></h5>\n<h5>\n	<span style="font-size:14px;">Patent : Taiwan, China</span></h5>\n<h5>\n	<span style="font-size:14px;">Approval : RoHS</span></h5>\n'),
(45, 34, 1, 'Chiayo Victory 2000', '<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Modulized Wireless Portable Sound System.</span></u></span></h5>\n<h5>\n	<span style="font-size:14px;">It is suitable to use in Indonesia where the power supply voltage fluctuates often high, because the system is equipped with a very wide voltage range of 90-264 volts AC, so the unit is guaranteed not easily damaged if used on low voltage (eg 140V, 150V) and high voltage (eg 240V, 250V).</span></h5>\n', '<h5>\n	<span style="font-size:14px;">The new type Victory 2000 has been equipped with additional built-in amplifiers 250 Watt, multimedia, multi-arena, designed for use both inside and outside the room, the capacity of the high quality sound to the room to about 1800m2 (2000 visitors), equipped mic system 16 channel ACT (optional) modular design making it easy and inexpensive maintenance costs, very practical and easy to transport places because it has a pull which can be stored inside the unit as well as a built-in wheels with a powerful, full-range speaker types (for low frequencies up to high) large size (10 inch / 4 ohms) and the frequency response of 50Hz - 20kHz, continuous operating capacity of up to 8 hours. Quality and reliability is assured because of manufacturer certified ISO 9001 international quality. Can be equipped with a tripod, and a water-resistant material fitted cover.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Master &amp; individual volume control.</span></h5>\n<h5>\n	<span style="font-size:14px;">Equipped with 2 mic, wireless clip-on &amp; wireless handheld, 105 meter range, both using AA size batteries.</span></h5>\n<h5>\n	<span style="font-size:14px;">Mic batteries (up to 4 pcs) could be recharge on the unit.</span></h5>\n<h5>\n	<span style="font-size:14px;">Mic volume could be set to mute the music (voice priority).</span></h5>\n<h5>\n	<span style="font-size:14px;">Special voice for ambulance, police, and fire figters.</span></h5>\n<h5>\n	<span style="font-size:14px;">CD/MP3 Player (anti shock), built-in USB port &amp; remote control, also available DVD/VCD/MP3/MP4/CD Player (remote control access front &amp; back).</span></h5>\n<h5>\n	<span style="font-size:14px;">Cassete tape recorder (pitch control system).</span></h5>\n<h5>\n	<span style="font-size:14px;">Echo (volume control available).</span></h5>\n<h5>\n	<span style="font-size:14px;">Inputs : line in &amp; 2 wired mic.</span></h5>\n<h5>\n	<span style="font-size:14px;">Outputs : external speaker, mix out, video out with video cable 2.75 meter.</span></h5>\n<h5>\n	<span style="font-size:14px;">Main battery could be recharge (6 hours only).</span></h5>\n<h5>\n	<span style="font-size:14px;">Unit casing made of Alumunium (better than polypropyline) which waterproof.</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Optional:</span></u></span></h5>\n<h5>\n	<span style="font-size:14px;">DVD/VCD/MP3/MP4/CD Player</span></h5>\n<h5>\n	<span style="font-size:14px;">Receiver RF (16 channel, pilihan channel sistim LED)</span></h5>\n<h5>\n	<span style="font-size:14px;">Sisa isi batere ditayangkan sistim LED</span></h5>\n<h5>\n	<span style="font-size:14px;">Built-in tempat penyimpanan mic handheld, mikropon clip-on, kabel power dan kabel video.</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Output power : 250 W / 4 ohm / 2000 audience</span></h5>\n<h5>\n	<span style="font-size:14px;">Speaker system : 10&quot; 2-way speaker &amp; crossover</span></h5>\n<h5>\n	<span style="font-size:14px;">T.H.D. : &lt; 0.5%</span></h5>\n<h5>\n	<span style="font-size:14px;">Operasional time : 5-6 hours (music), 8 hours (mic)</span></h5>\n<h5>\n	<span style="font-size:14px;">Recharging time : 7 hours</span></h5>\n<h5>\n	<span style="font-size:14px;">Dimension (mm) : 600(H) x 350(W) x 300(D)</span></h5>\n<h5>\n	<span style="font-size:14px;">Weight (kg) : 21 kg</span></h5>\n<h5>\n	<span style="font-size:14px;">Frequency Response : 50Hz - 20kHz +-3dB</span></h5>\n<h5>\n	<span style="font-size:14px;">Frequency Range : UHF (600 - 980 MHz)</span></h5>\n<h5>\n	<span style="font-size:14px;">Programmed Freq. : Fixed (optional 16 channel)</span></h5>\n');
INSERT INTO `tbl_product_content` (`id`, `product_id`, `lang_id`, `subject`, `text`, `overview`, `features`, `specification`) VALUES
(46, 34, 2, 'Chiayo Victory 2000', '<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size: 14px;">Modulized Wireless Portable Sound System.</span></u></span></h5>\n<h5>\n	<span style="font-size: 14px;">Sangat cocok digunakan di Indonesia dimana tegangan listrik sering berfluktuasi tinggi, karena dilengkapi dengan sistim rentang voltase yang sangat luas dari 90 - 264 Volt AC, sehingga alat sangat terjamin tidak mudah rusak kalau digunakan pada voltase rendah (misalnya pada 140V, 150V) dan tinggi (misalnya pada 240V, 250V).</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Tipe baru Victory 2000 telah dilengkapi dengan fitur tambahan amplifier built-in 250 Watt, multimedia, multi-arena, dirancang untuk digunakan baik di dalam maupun di luar ruangan, kapasitas suara kualitas tinggi untuk ruangan hingga sekitar 1800m2 (2000 pengunjung), dilengkapi mic sistem 16 channel ACT (opsional) rancangan moduler sehingga mudah dan murah biaya perawatannya, sangat praktis dan mudah untuk dipindah tempat karena dilengkapi tarikan, dapat disimpan di dalam alat serta dengan roda built-in yang kuat, speaker jenis full-range (untuk frekuensi rendah hingga tinggi) ukurang besar (10 inch / 4 ohm) serta frekwensi respon 50Hz - 20kHz, kapasitas operasi hingga terus menerus 8 jam. Kualitas dan keandalan terjamin karena dari produsen yang bersertifikasi mutu internasional ISO 9001. Dapat dilengkapi tripod, dan dilengkapi sarung bahan kedap air.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Master &amp; individual volume kontrol</span></h5>\n<h5>\n	<span style="font-size:14px;">Dilengkapi 2 mic. clip-on dan handheld (nirkabel), jangkauan jarak hingga 105 meter, menggunakan batere ukuran AA pada kedua mic ini.</span></h5>\n<h5>\n	<span style="font-size:14px;">Batere mic (hingga 4 buah) dapat diisi ulang pada unit.</span></h5>\n<h5>\n	<span style="font-size:14px;">Suara mic dapat disetel meredam suara musik (voice priority).</span></h5>\n<h5>\n	<span style="font-size:14px;">Fitur istimewa suara sirine untuk pilihan : ambulan, polisi, dan kebakaran.</span></h5>\n<h5>\n	<span style="font-size:14px;">CD/MP3 Player (rancangan anti getar), built-in USB port &amp; remote kontrol, dapat pula dilengkapi DVD/VCD/MP3/MP4/CD Player (akses remote kontrol depan belakang).</span></h5>\n<h5>\n	<span style="font-size:14px;">Kaset tape rekorder (sistem pitch kontrol).</span></h5>\n<h5>\n	<span style="font-size:14px;">Echo (volume dapat diatur).</span></h5>\n<h5>\n	<span style="font-size:14px;">Terminal-terminal input: line in &amp; 2 wired mic.</span></h5>\n<h5>\n	<span style="font-size:14px;">Terminal-terminal output: external speaker, mix out, video out dengan kabel video 2.75 meter.</span></h5>\n<h5>\n	<span style="font-size:14px;">Batere utama unit dapat diisi ulang (cukup 6 jam).</span></h5>\n<h5>\n	<span style="font-size:14px;">Casing unit dari bahan alumunium (mutu lebih baik dari bahan polypropyline) yang kedap air.</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Optional:</span></u></span></h5>\n<h5>\n	<span style="font-size:14px;">DVD/VCD/MP3/MP4/CD Player</span></h5>\n<h5>\n	<span style="font-size:14px;">Receiver RF (16 channel, pilihan channel sistim LED)</span></h5>\n<h5>\n	<span style="font-size:14px;">Sisa isi batere ditayangkan sistim LED</span></h5>\n<h5>\n	<span style="font-size:14px;">Built-in tempat penyimpanan mic handheld, mikropon clip-on, kabel power dan kabel video.</span></h5>\n', '<h5>\n	<span style="font-size: 14px;">Output power : 250 W / 4 ohm / 900 pengunjung</span></h5>\n<h5>\n	<span style="font-size:14px;">Speaker system : 10&quot; 2-way speaker &amp; crossover</span></h5>\n<h5>\n	<span style="font-size:14px;">T.H.D. : &lt; 0.5%</span></h5>\n<h5>\n	<span style="font-size:14px;">Kemampuan operasional : 5-6 jam (musik), 8 jam (mic)</span></h5>\n<h5>\n	<span style="font-size:14px;">waktu isi ulang batere : 7 jam</span></h5>\n<h5>\n	<span style="font-size:14px;">Dimension (mm) : 600(H) x 350(W) x 300(D)</span></h5>\n<h5>\n	<span style="font-size:14px;">Weight (kg) : 21 kg</span></h5>\n<h5>\n	<span style="font-size:14px;">Frequency Response : 50Hz - 20kHz +-3dB</span></h5>\n<h5>\n	<span style="font-size:14px;">Frequency Range : UHF (600 - 980 MHz)</span></h5>\n<h5>\n	<span style="font-size:14px;">Programmed Freq. : Fixed (optional 16 channel)</span></h5>\n'),
(47, 35, 1, 'Projector Screen Infiniter Narration', '<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Various Projector Screen</span></u></span></h5>\n<h5>\n	<span style="font-size:14px;">- Electric screen</span></h5>\n<h5>\n	<span style="font-size:14px;">- Tripod Stand Screen</span></h5>\n<h5>\n	<span style="font-size:14px;">- Pelmet (Wall mount) Screen</span></h5>\n<h5>\n	<span style="font-size:14px;">- Floor stand screen</span></h5>\n', '<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Various Projector Screen</span></u></span></h5>\n<h5>\n	<span style="font-size:14px;">- Electric screen</span></h5>\n<h5>\n	<span style="font-size:14px;">- Tripod Stand Screen</span></h5>\n<h5>\n	<span style="font-size:14px;">- Pelmet (Wall mount) Screen</span></h5>\n<h5>\n	<span style="font-size:14px;">- Floor stand screen</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n', '', '<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Electric screen</span></span></h5>\n<h5>\n	<span style="font-size:14px;">[4:3] 80&quot;, 92&quot;, 100&quot;, 120&quot;, 150&quot;, 200&quot;</span></h5>\n<h5>\n	<span style="font-size:14px;">[16:9] 80&quot;, 90&quot;, 100&quot;, 120&quot;</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Tripod Stand Screen</span></span></h5>\n<h5>\n	<span style="font-size:14px;">[1:1] 50&quot;, 60&quot;, 70&quot;, 80&quot;, 96&quot;</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Pelmet (Wall mount) Screen</span></span></h5>\n<h5>\n	<span style="font-size:14px;">[1:1] 70&quot;, 80&quot;</span></h5>\n<h5>\n	<span style="font-size:14px;">[4:3] 80&quot;, 100&quot;, 150&quot;</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Floor st