(48, 35, 2, 'Projector Screen Infiniter Narration', '<h5>\n	<span style="color:#ff8c00;"><u><span style="font-size:14px;">Berbagai jenis layar proyektor</span></u></span></h5>\n<h5>\n	<span style="font-size:14px;">- Layar elektrik</span></h5>\n<h5>\n	<span style="font-size:14px;">- Layar stand tripod</span></h5>\n<h5>\n	<span style="font-size:14px;">- Layar wall mount</span></h5>\n<h5>\n	<span style="font-size:14px;">- Layar duduk lantai</span></h5>\n', '<h5>\n	<span style="color: rgb(255, 140, 0);"><u><span style="font-size: 14px;">Berbagai jenis layar proyektor</span></u></span></h5>\n<h5>\n	<span style="font-size: 14px;">- Layar elektrik</span></h5>\n<h5>\n	<span style="font-size: 14px;">- Layar stand tripod</span></h5>\n<h5>\n	<span style="font-size: 14px;">- Layar wall mount</span></h5>\n<h5>\n	<span style="font-size: 14px;">- Layar duduk lantai</span></h5>\n', '', '<h5>\n	<span style="color:#ff8c00;"><span style="font-size: 14px;">Layar elektrik</span></span></h5>\n<h5>\n	<span style="font-size:14px;">[4:3] 80&quot;, 92&quot;, 100&quot;, 120&quot;, 150&quot;, 200&quot;</span></h5>\n<h5>\n	<span style="font-size:14px;">[16:9] 80&quot;, 90&quot;, 100&quot;, 120&quot;</span></h5>\n<p>\n	&nbsp;</p>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Layar stand tripod</span></span></h5>\n<h5>\n	<span style="font-size:14px;">[1:1] 50&quot;, 60&quot;, 70&quot;, 80&quot;, 96&quot;</span></h5>\n<p>\n	&nbsp;</p>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Layar wall mount</span></span></h5>\n<h5>\n	<span style="font-size:14px;">[1:1] 70&quot;, 80&quot;</span></h5>\n<h5>\n	<span style="font-size:14px;">[4:3] 80&quot;, 100&quot;, 150&quot;</span></h5>\n<p>\n	&nbsp;</p>\n<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Layar duduk lantai</span></span></h5>\n<h5>\n	<span style="font-size:14px;">[4:3] 80&quot;</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n<h5>\n	<span style="color:#f00;"><span style="font-size:14px;">Mohon cek brosur dan hubungi kami untuk informasi lebih detil.</span></span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n'),
(49, 36, 1, 'Vivitek D551 Naration', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">The Vivitek D551</span> digital projector is ready for current and future media applications. With connectivity ptions including VGA-in (2x) and VGA-out loopthrough Composite, Audio-in/out, the D551 is also 3D ready via DLP link for entertainment, features a high brightness of 3000 ANSI Lumens and a 15000:1 contrast ratio. The D551 is able to deliver sharp, vibrant pictures. The new high efficiency lamp that lasts up to 10,000 hours, which makes the D551 an economic projector to run.</span></h5>\n', '', '<h5>\n	<span style="font-size:14px;">- High 15,000:1 contrast ratio ensures a crisp and sharp image</span></h5>\n<h5>\n	<span style="font-size:14px;">- Superior 3,000 ANSI lumens for projection in even well-lit rooms</span></h5>\n<h5>\n	<span style="font-size:14px;">- DLP&reg; BrilliantColor&trade; technologies for excellent color reproduction</span></h5>\n<h5>\n	<span style="font-size:14px;">- Native XGA resolution with display up to UXGA (1600 x 1200)@60Hz</span></h5>\n<h5>\n	<span style="font-size:14px;">- Connectivity options including: VGA-In, S-Video, Composite Video, and RS-232C</span></h5>\n<h5>\n	<span style="font-size:14px;">- 3D-Ready via DLP Link&trade;</span></h5>\n<h5>\n	<span style="font-size:14px;">- Audio ready with built-in 2 watt audio speaker</span></h5>\n<h5>\n	<span style="font-size:14px;">- Convenient top loading design for easy lamp replacement</span></h5>\n<h5>\n	<span style="font-size:14px;">- Energy consumption is reduced to less than 0.5W in stand-by mode</span></h5>\n<h5>\n	<span style="font-size:14px;">- Keypad lock prevents accidental system adjustments</span></h5>\n<h5>\n	<span style="font-size:14px;">- 2.3kg for easy portability</span></h5>\n', '<h5>\n	<span style="font-size: 14px;">Display Type : DLP&reg; BrilliantColor&trade; Technology</span></h5>\n<h5>\n	<span style="font-size:14px;">Brightness : 3000 ANSI Lumens</span></h5>\n<h5>\n	<span style="font-size:14px;">Native Resolution : XGA (1024 x 768)</span></h5>\n<h5>\n	<span style="font-size:14px;">Maximum Resolution : UXGA (1600 x 1200)@60Hz</span></h5>\n<h5>\n	<span style="font-size:14px;">Contrast Ratio : 15000:1</span></h5>\n<h5>\n	<span style="font-size:14px;">Uniformity : 95%</span></h5>\n<h5>\n	<span style="font-size:14px;">Lamp Life and Type : 5,000/6,000/10,000 Hours (Std./Eco/Dyn.Eco Mode)</span></h5>\n<h5>\n	<span style="font-size:14px;">Throw Ratio : 1.92-2.14:1</span></h5>\n<h5>\n	<span style="font-size:14px;">Image Size (Diagonal) : 23&quot;- 256&quot;</span></h5>\n<h5>\n	<span style="font-size:14px;">Projection Distance : 1 -10m (3.28ft &ndash; 32.8ft)</span></h5>\n<h5>\n	<span style="font-size:14px;">Projection Lens : F = 2.52 - 2.73, f = 21.8 - 24mm</span></h5>\n<h5>\n	<span style="font-size:14px;">Zoom Ratio : 1.1x</span></h5>\n<h5>\n	<span style="font-size:14px;">Aspect Ratio : 4:3 Native</span></h5>\n<h5>\n	<span style="font-size:14px;">Offset : 128% &plusmn; 10%</span></h5>\n<h5>\n	<span style="font-size:14px;">Keystone Correction : Vertical &plusmn; 40&deg; (&plusmn;40 Step)</span></h5>\n<h5>\n	<span style="font-size:14px;">Horizontal Frequency : 2D: 15,30 &ndash; 91.4kHz/3D: 101.6kHz</span></h5>\n<h5>\n	<span style="font-size:14px;">Vertical Scan Rate : 24 - 30Hz, 47 &ndash; 120Hz</span></h5>\n<h5>\n	<span style="font-size:14px;">Speakers : 2W (Mono)</span></h5>\n<h5>\n	<span style="font-size:14px;">3D Ready : Yes (via DLP Link)</span></h5>\n<h5>\n	<span style="font-size:14px;">Video Compatibility : SDTV(480i, 576i), EDTV (480p, 576p), HDTV (720p,1080i/p), NTSC (M, 3.58/4.43 Hz), PAL (B, D, G, H, I, M, N), SECAM (B, D, G, K, K1, L)</span></h5>\n<h5>\n	<span style="font-size:14px;">I/O Connection Ports : VGA-In (x2), S-Video, Composite Video, Audio-In (Mini-Jack), VGA-Out, Audio-Out (Mini-Jack), RS-232, Mini-USB (Service)</span></h5>\n<h5>\n	<span style="font-size:14px;">Projection Method : Table Top, Ceiling Mount (Front or Rear)</span></h5>\n<h5>\n	<span style="font-size:14px;">Security Solutions : Kensington&reg; Security Slot, Keypad Lock</span></h5>\n<h5>\n	<span style="font-size:14px;">Dimensions (W x D x H) : 274.6x 212 x 100mm</span></h5>\n<h5>\n	<span style="font-size:14px;">Weight : 2.3kg</span></h5>\n<h5>\n	<span style="font-size:14px;">Noise Level : 35dB/32dB (Normal/Eco Mode)</span></h5>\n<h5>\n	<span style="font-size:14px;">Power Supply : AC 100-240V, 50/ 60Hz</span></h5>\n<h5>\n	<span style="font-size:14px;">Power Consumption : 240W (Normal Mode), 200W (Eco Mode), &lt;0.5W (Standby Mode)</span></h5>\n<h5>\n	<span style="font-size:14px;">Standard Accessories : AC Power Cord, VGA Cable, Remote Control w/Batteries, Documentation Kit</span></h5>\n'),
(50, 36, 2, 'Vivitek D551 Naration', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">The Vivitek D551</span> digital projector is ready for current and future media applications. With connectivity ptions including VGA-in (2x) and VGA-out loopthrough Composite, Audio-in/out, the D551 is also 3D ready via DLP link for entertainment, features a high brightness of 3000 ANSI Lumens and a 15000:1 contrast ratio. The D551 is able to deliver sharp, vibrant pictures. The new high efficiency lamp that lasts up to 10,000 hours, which makes the D551 an economic projector to run.</span></h5>\n', '', '<h5>\n	<span style="font-size:14px;">&nbsp;- High 15,000:1 contrast ratio ensures a crisp and sharp image</span></h5>\n<h5>\n	<span style="font-size:14px;">- Superior 3,000 ANSI lumens for projection in even well-lit rooms</span></h5>\n<h5>\n	<span style="font-size:14px;">- DLP&reg; BrilliantColor&trade; technologies for excellent color reproduction</span></h5>\n<h5>\n	<span style="font-size:14px;">- Native XGA resolution with display up to UXGA (1600 x 1200)@60Hz</span></h5>\n<h5>\n	<span style="font-size:14px;">- Connectivity options including: VGA-In, S-Video, Composite Video, and RS-232C</span></h5>\n<h5>\n	<span style="font-size:14px;">- 3D-Ready via DLP Link&trade;</span></h5>\n<h5>\n	<span style="font-size:14px;">- Audio ready with built-in 2 watt audio speaker</span></h5>\n<h5>\n	<span style="font-size:14px;">- Convenient top loading design for easy lamp replacement</span></h5>\n<h5>\n	<span style="font-size:14px;">- Energy consumption is reduced to less than 0.5W in stand-by mode</span></h5>\n<h5>\n	<span style="font-size:14px;">- Keypad lock prevents accidental system adjustments</span></h5>\n<h5>\n	<span style="font-size:14px;">- 2.3kg for easy portability</span></h5>\n', '<h5>\n	<span style="font-size: 14px;">Display Type : DLP&reg; BrilliantColor&trade; Technology</span></h5>\n<h5>\n	<span style="font-size: 14px;">Brightness : 3000 ANSI Lumens</span></h5>\n<h5>\n	<span style="font-size: 14px;">Native Resolution : XGA (1024 x 768)</span></h5>\n<h5>\n	<span style="font-size: 14px;">Maximum Resolution : UXGA (1600 x 1200)@60Hz</span></h5>\n<h5>\n	<span style="font-size: 14px;">Contrast Ratio : 15000:1</span></h5>\n<h5>\n	<span style="font-size: 14px;">Uniformity : 95%</span></h5>\n<h5>\n	<span style="font-size: 14px;">Lamp Life and Type : 5,000/6,000/10,000 Hours (Std./Eco/Dyn.Eco Mode)</span></h5>\n<h5>\n	<span style="font-size: 14px;">Throw Ratio : 1.92-2.14:1</span></h5>\n<h5>\n	<span style="font-size: 14px;">Image Size (Diagonal) : 23&quot;- 256&quot;</span></h5>\n<h5>\n	<span style="font-size: 14px;">Projection Distance : 1 -10m (3.28ft &ndash; 32.8ft)</span></h5>\n<h5>\n	<span style="font-size: 14px;">Projection Lens : F = 2.52 - 2.73, f = 21.8 - 24mm</span></h5>\n<h5>\n	<span style="font-size: 14px;">Zoom Ratio : 1.1x</span></h5>\n<h5>\n	<span style="font-size: 14px;">Aspect Ratio : 4:3 Native</span></h5>\n<h5>\n	<span style="font-size: 14px;">Offset : 128% &plusmn; 10%</span></h5>\n<h5>\n	<span style="font-size: 14px;">Keystone Correction : Vertical &plusmn; 40&deg; (&plusmn;40 Step)</span></h5>\n<h5>\n	<span style="font-size: 14px;">Horizontal Frequency : 2D: 15,30 &ndash; 91.4kHz/3D: 101.6kHz</span></h5>\n<h5>\n	<span style="font-size: 14px;">Vertical Scan Rate : 24 - 30Hz, 47 &ndash; 120Hz</span></h5>\n<h5>\n	<span style="font-size: 14px;">Speakers : 2W (Mono)</span></h5>\n<h5>\n	<span style="font-size: 14px;">3D Ready : Yes (via DLP Link)</span></h5>\n<h5>\n	<span style="font-size: 14px;">Video Compatibility : SDTV(480i, 576i), EDTV (480p, 576p), HDTV (720p,1080i/p), NTSC (M, 3.58/4.43 Hz), PAL (B, D, G, H, I, M, N), SECAM (B, D, G, K, K1, L)</span></h5>\n<h5>\n	<span style="font-size: 14px;">I/O Connection Ports : VGA-In (x2), S-Video, Composite Video, Audio-In (Mini-Jack), VGA-Out, Audio-Out (Mini-Jack), RS-232, Mini-USB (Service)</span></h5>\n<h5>\n	<span style="font-size: 14px;">Projection Method : Table Top, Ceiling Mount (Front or Rear)</span></h5>\n<h5>\n	<span style="font-size: 14px;">Security Solutions : Kensington&reg; Security Slot, Keypad Lock</span></h5>\n<h5>\n	<span style="font-size: 14px;">Dimensions (W x D x H) : 274.6x 212 x 100mm</span></h5>\n<h5>\n	<span style="font-size: 14px;">Weight : 2.3kg</span></h5>\n<h5>\n	<span style="font-size: 14px;">Noise Level : 35dB/32dB (Normal/Eco Mode)</span></h5>\n<h5>\n	<span style="font-size: 14px;">Power Supply : AC 100-240V, 50/ 60Hz</span></h5>\n<h5>\n	<span style="font-size: 14px;">Power Consumption : 240W (Normal Mode), 200W (Eco Mode), &lt;0.5W (Standby Mode)</span></h5>\n<h5>\n	<span style="font-size: 14px;">Standard Accessories : AC Power Cord, VGA Cable, Remote Control w/Batteries, Documentation Kit</span></h5>\n'),
(51, 37, 1, 'Vivitek D751ST', '<p>\n	Projector Vivitek D751ST</p>\n', '', '', ''),
(52, 37, 2, 'Vivitek D751ST', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;">Proyektor Vivitek D751ST XGQ</span> ultra-short throw dapat menghasilkan gambar 85&quot; hanya dengan jarak 2.5&#39;</span></h5>\n<h5>\n	<span style="font-size:14px;">Proyektor ini menampilkan gambar dengan kecerahan 3000 lumens, rasio kontras 5000:1, lampu hingga 8000 jam dengan menggunakan Eco mode, dilengkapi teknologi DLP dan BriliantColor yang menghasilkan reproduksi warna dan gambar yang memukau. Dilengkapi berbagai pilihan konektivitas dan speaker terintegrasi, D751ST merupakan solusi tepat kebutuhan multimedia masa kini.</span></h5>\n', '<h5>\n	<span style="font-size:14px;">- Kecerahan 3000 lumens dengan rasio kontras 5000:1</span></h5>\n<h5>\n	<span style="font-size:14px;">- Jarak proyeksi ultra short-throw yang mencegah bayangan dan silau</span></h5>\n<h5>\n	<span style="font-size:14px;">- Lampu hemat energi yang bisa bertahan 8000 jam pada Eco Mode</span></h5>\n<h5>\n	<span style="font-size:14px;">- 3D-ready menggunakan DLP Link</span></h5>\n<h5>\n	<span style="font-size:14px;">- Teknologi DLP dan BriliantColot oleh Texas Instrument</span></h5>\n<h5>\n	<span style="font-size:14px;">- Pilihan konektivitas meliputi HDMI v1.4, dua VGA-in, composite video, S-video</span></h5>\n<h5>\n	<span style="font-size:14px;">- Mesin optik tersegel, mencegah debu dan asap masuk</span></h5>\n<h5>\n	<span style="font-size:14px;">- Mendukung pengaturan dan integrasi melalui jaringan menggunakan RJ-45</span></h5>\n<h5>\n	<span style="font-size:14px;">- Penutup bertipe Top-loading, memudahkan perggantian lampu</span></h5>\n', '', ''),
(53, 38, 1, 'Vivitek D755WTi', '<p>\n	Vivitek D755WTi</p>\n', '', '', ''),
(54, 38, 2, 'Vivitek D755WTi', '<h5>\n	<span style="font-size: 14px;"><span style="color:#ff8c00;">D755WTi</span> merupakan projektor ultra-short-throw dengan fungsi interaktif terintegrasi yang mampu membuat layar standar apapun atau permukaan datar menjadi solusi proyeksi interaktif. <span style="color:#ff8c00;">D755WTI</span> menampilkan kecerahan 3000 ANSI Lumens dan rasio kontras 5000:1 untuk tampilan gambar sempurna. <span style="color:#ff8c00;">D7555WTi</span> merupakan projektor penuh fitur dengan dukungan DLP-3D Ready, speaker terintegrasi 10Wx2, serta berbagai opsi konektivitas termasuk HDMI v1.3 untuk transmisi digital gambar dan RJ-45 untuk konektivitas jaringan. D755WTi merupakan projektor terbaik untuk presentasi yang sempurna</span></h5>\n', '<h5>\n	<span style="font-size:14px;">- Teknologi DLP dan Briliant Color untuk kualitas gambar yang tajam dan detail</span></h5>\n<h5>\n	<span style="font-size:14px;">- Fungsi IWB terintegrasi dengan pen interaktif</span></h5>\n<h5>\n	<span style="font-size:14px;">- Menampilkan gambar lebar, 80&quot; hingga 100 &quot; dari jarak ultra-short, sangat membantu mencegah bayangan objek dan cahaya silau yang mengganggu presenter.</span></h5>\n<h5>\n	<span style="font-size:14px;">- Kecerahan 3000 ANSI lumend dengan rasio kontras 5000:1</span></h5>\n<h5>\n	<span style="font-size:14px;">- Lampu efisien listrik yang mampu bertahan hingga 8000 jam (dalam modus ekonomis)</span></h5>\n<h5>\n	<span style="font-size:14px;">- VGA-output untuk tampilan ke monitor sekunder&nbsp;</span></h5>\n<h5>\n	<span style="font-size:14px;">- Speaker 10Wx2 terintegrasi</span></h5>\n<h5>\n	<span style="font-size:14px;">- Penutup top-loading untuk kemudahan saat mengganti lampu</span></h5>\n<h5>\n	<span style="font-size:14px;">- Mesin optik tersegel untuk mencegah kerusakan karena debu dan asap</span></h5>\n<h5>\n	<span style="font-size:14px;">- Keypad-lock untuk mencegaj seting terubah secara tidak sengaja</span></h5>\n', '', ''),
(55, 39, 1, 'Vivitek D855ST 1', '<p>\n	Vivitek D855ST/D857WT memberikan kinerja, fleksibilitas, dan efisiensi. Vivitek D855ST/B8557WT menawarkan resolusi HDTV, fitur start-up dan shut down super cepat, dan pengoperasian yang sangat mudah. Proyektor Digital D855ST/D857WT juga memiliki berbagai pilihan koneksi, teknologi DLP, BriliantColor, dan daur hidup lampu hingga 6000 jam.</p>\n', '', '', ''),
(56, 39, 2, 'Vivitek D855ST 1', '<h5>\n	<span style="font-size:14px;"><span style="color:#ff8c00;"><u>Vivitek D855ST/D857WT</u></span> memberikan kinerja, fleksibilitas, dan efisiensi. Vivitek D855ST/B8557WT menawarkan resolusi HDTV, fitur start-up dan shut down super cepat, dan pengoperasian yang sangat mudah. Proyektor Digital D855ST/D857WT juga memiliki berbagai pilihan koneksi, teknologi DLP, BriliantColor, dan daur hidup lampu hingga 6000 jam.</span></h5>\n', '', '<h5>\n	<span style="font-size:14px;">- Resolusi native XGA/WXGA hingga UXGA (1600 x 1200)</span></h5>\n<h5>\n	<span style="font-size:14px;">- Brightness 3000 lumens dengan Contrast Ratio 3000 : 1</span></h5>\n<h5>\n	<span style="font-size:14px;">- 3D-Ready dengan DLP Link</span></h5>\n<h5>\n	<span style="font-size:14px;">- Lampu dengan efisiensi tinggi dengan daur hidup hingga 6000 jam (pada economy mode)</span></h5>\n<h5>\n	<span style="font-size:14px;">- Output VGA untuk tampilan pada monitor tambahan</span></h5>\n<h5>\n	<span style="font-size:14px;">- Keypad Lock untuk pengamanan</span></h5>\n<h5>\n	<span style="font-size:14px;">- Enhanced color</span></h5>\n<h5>\n	<span style="font-size:14px;">- Penyesuaian tampilan</span></h5>\n<h5>\n	<span style="font-size:14px;">- Integrasi jaringan dan sistem administrasi dengan RJ45</span></h5>\n', ''),
(57, 40, 1, 'Vivitek D871ST 1', '<h5>\n	<span style="font-size:14px;">Vivitek D871ST</span></h5>', '', '', ''),
(58, 40, 2, 'Vivitek D871ST 1', '<h5>\n	<span style="font-size:14px;">Vivitek D871ST</span></h5>\n<h5>\n	<span style="font-size:14px;">Tampilan lebar projektor short throw dengan dukungan 3D</span></h5>\n', '', '<h5>\n	<span style="font-size:14px;">- Resolusi XGA native dan mampu menampilkan hingga UXGA [1600x1200]</span></h5>\n<h5>\n	<span style="font-size:14px;">- Kualitas gambar tajam dan detil dengan teknologi DLP dan BriliantColor</span></h5>\n<h5>\n	<span style="font-size:14px;">- Tampilan gambar besar hingga 82&quot; hanya dengan jarak 1 meter</span></h5>\n<h5>\n	<span style="font-size:14px;">- Kecerahan 2800 ANSI lumens dengan rasio kontras 3500:1</span></h5>\n<h5>\n	<span style="font-size:14px;">- Lampu efisiensi tinggi yang mampu bertahan hingga 6000 jam (pada modus standar)</span></h5>\n<h5>\n	<span style="font-size:14px;">- 3D-Ready menggunakan DLP Link</span></h5>\n<h5>\n	<span style="font-size:14px;">- Memperkaya warna dan penyesuaian tampilan</span></h5>\n<h5>\n	<span style="font-size:14px;">- Desain tutup top loading yang mempermudah penggantian lampu</span></h5>\n<h5>\n	<span style="font-size:14px;">- Komponen optik yang disegel untuk mencegah debu</span></h5>\n<h5>\n	<span style="font-size:14px;">- Mendukung integrasi dan administrasi melalui jaringan menggunakan Rj45</span></h5>\n<h5>\n	<span style="font-size:14px;">- Speaker 10W terintegrasi</span></h5>\n', '<h5>\n	<span style="font-size:14px;">Display Type : DLP</span></h5>\n<h5>\n	<span style="font-size:14px;">Brightness : 2800 ANSI Lumens</span></h5>\n<h5>\n	<span style="font-size:14px;">Native Resolution : XGA (1024x768)</span></h5>\n<h5>\n	<span style="font-size:14px;">maximum Resolution : UXGA (1600x1200)</span></h5>\n<h5>\n	<span style="font-size:14px;">Contrast Ratio : 1.500:1</span></h5>\n<h5>\n	<span style="font-size:14px;">Lamp Life dan Tipe : 4.500/6.000 Hours (Boost/Std, Mode), 190W</span></h5>\n<h5>\n	<span style="font-size:14px;">Throw Ratio : 0.6 (82&quot; @ 1m)</span></h5>\n<h5>\n	<span style="font-size:14px;">Image Size (Diagonal) : 41&quot;-328&quot;</span></h5>\n<h5>\n	<span style="font-size:14px;">Projection Distance : 0.5 - 4m (1.6ft-13.2ft)</span></h5>\n<h5>\n	<span style="font-size:14px;">Projection Lens : F=2.7, f=6.82mm</span></h5>\n<h5>\n	<span style="font-size:14px;">Zoom Ration : Fixed Lens</span></h5>\n<h5>\n	<span style="font-size:14px;">Aspect Ratio : 4:3 Native, 16:9 Compatible</span></h5>\n<h5>\n	<span style="font-size:14px;">Offset : 128% +/- 10%</span></h5>\n<h5>\n	<span style="font-size:14px;">Keystone Correction : Vertical +/- 40</span></h5>\n<h5>\n	<span style="font-size:14px;">Horizontal Frequency : 15, 30-90 kHz</span></h5>\n<h5>\n	<span style="font-size:14px;">Vertical Scan Rate : 43-85 Hz</span></h5>\n<h5>\n	<span style="font-size:14px;">Speakers : 10W (Mono)</span></h5>\n<h5>\n	<span style="font-size:14px;">Lens Shift Range : N/A</span></h5>\n<h5>\n	<span style="font-size:14px;">Video Compatibility : STDTV (480i), EDTV (480p), HDTV (720p, 1080i), NTSC/NTSC 4.43, PAL B/G/H/I/M/N 60, SECAM</span></h5>\n<h5>\n	<span style="font-size:14px;">I/O Connection Ports : HDMI 1.3V (X2), VGA-In, S-Video, Composite Video, Audio-In RCA (L/R), Audio-In (Mini-Jack), RJ45, RS-232C, USB (Service)</span></h5>\n<h5>\n	<span style="font-size:14px;">Projection Method : Table Top, Ceiling Mount (Front or Rear)</span></h5>\n<h5>\n	<span style="font-size:14px;">Security Solutions : Kensington Security Slot, Security Bar, Keypad Lock</span></h5>\n<h5>\n	<span style="font-size:14px;">Dimensions (W x D x W) : 280 x 260 x 113 mm (11.02&quot; x 10.23&quot; x 4.44&quot;)</span></h5>\n<h5>\n	<span style="font-size:14px;">Weight : 2.7Kg (6Ibs)</span></h5>\n<h5>\n	<span style="font-size:14px;"><br />\n	</span></h5>\n'),
(59, 41, 1, 'Vivitek D8900 A', '<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Vivitek D8900</span></span></h5>\n<h5>\n	<span style="font-size:14px;">Large venue projector with 10000 ANSI Lumens of brightness</span></h5>\n', '', '<h5>\n	<span style="font-size: 14px;">- 10000 ANSI lumens for ultimate brightness</span></h5>\n<h5>\n	<span style="font-size: 14px;">- Native XGA (1024 x 768) resolution with maximum UXGA (1600 x 1200)&nbsp;</span><span style="font-size: 14px;">@60Hz resolution</span></h5>\n<h5>\n	<span style="font-size: 14px;">- DLP and BriliantColor technologies for superb image quality</span></h5>\n<h5>\n	<span style="font-size: 14px;">- Built-in hardware edge blending and warping functionality</span></h5>\n<h5>\n	<span style="font-size: 14px;">- Interchangeable lens options for a variety of installation scenarios&nbsp;</span><span style="font-size: 14px;">(6 types)</span></h5>\n<h5>\n	<span style="font-size: 14px;">- Connectivity options including : HDMI v1.3, DVI-D, Component, 3G&nbsp;</span><span style="font-size: 14px;">SDI-In, 3G SDI-Out, VGA-In, VGA-Out, RJ45 and RS-232</span></h5>\n<h5>\n	<span style="font-size: 14px;">- Front and side replaceable filters</span></h5>\n<h5>\n	<span style="font-size: 14px;">- Network ready for integration and system administration via RJ45</span></h5>\n<h5>\n	<span style="font-size: 14px;">- Built-in 12V trigger</span></h5>\n<h5>\n	<span style="font-size: 14px;">- Convenient lamp replacement design</span></h5>\n', ''),
(60, 41, 2, 'Vivitek D8900', '<h5>\n	<span style="color:#ff8c00;"><span style="font-size:14px;">Vivitek D8900</span></span></h5>\n<h5>\n	<span style="font-size:14px;">Large venue projector with 10000 ANSI Lumens of brightness</span></h5>\n', '', '<h5>\n	<span style="font-size:14px;">- 10000 ANSI lumens for ultimate brightness</span></h5>\n<h5>\n	<span style="font-size:14px;">- Native XGA (1024 x 768) resolution with maximum UXGA (1600 x 1200)&nbsp;</span><span style="font-size: 14px;">@60Hz resolution</span></h5>\n<h5>\n	<span style="font-size:14px;">- DLP and BriliantColor technologies for superb image quality</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in hardware edge blending and warping functionality</span></h5>\n<h5>\n	<span style="font-size:14px;">- Interchangeable lens options for a variety of installation scenarios&nbsp;</span><span style="font-size: 14px;">(6 types)</span></h5>\n<h5>\n	<span style="font-size:14px;">- Connectivity options including : HDMI v1.3, DVI-D, Component, 3G&nbsp;</span><span style="font-size: 14px;">SDI-In, 3G SDI-Out, VGA-In, VGA-Out, RJ45 and RS-232</span></h5>\n<h5>\n	<span style="font-size:14px;">- Front and side replaceable filters</span></h5>\n<h5>\n	<span style="font-size:14px;">- Network ready for integration and system administration via RJ45</span></h5>\n<h5>\n	<span style="font-size:14px;">- Built-in 12V trigger</span></h5>\n<h5>\n	<span style="font-size:14px;">- Convenient lamp replacement design</span></h5>\n', '');
