INSERT INTO `tbl_solution_content` (`id`, `solution_id`, `lang_id`, `subject`, `synopsis`, `text`, `combination1`, `combination2`, `combination3`) VALUES
(3, 2, 1, 'AHA SMART PODIUM ELF-192D', NULL, '<h6 style="margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-size: 14px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; background: rgb(255, 253, 232);">\n	What is AHA Smart Podium?</h6>\n<ul style="margin: 0px; padding: 0px 0px 0px 20px; border: 0px; outline: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 12px; background: rgb(255, 253, 232);">\n	<li style="margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-size: 14px; line-height: 20px; background: transparent;">\n		The Elf system enables the user to write on a tablet monitor built into the podium</li>\n	<li style="margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-size: 14px; line-height: 20px; background: transparent;">\n		The core technology system allows the user to directly write on a multimedia teaching plan and save<br />\n		the images along with the voice, for the easy production of multimedia learning contents.</li>\n	<li style="margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-size: 14px; line-height: 20px; background: transparent;">\n		The Elf has a built-in sound system (amplifier, wired/wireless microphone, etc..) for e-learning and&nbsp;<br />\n		can be interfaced to all multimedia devices to facilities their user as teaching tools The embedded&nbsp;<br />\n		Integrated controller allows the control of devices with a single key and supports plug &amp; play function.</li>\n</ul>\n<p style="margin: 1px 0px 15px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; line-height: 20px; font-size: 14px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; background: rgb(255, 253, 232);">\n	It is ideal for classrooms equipped with an</p>\n<ul style="margin: 0px; padding: 0px 0px 0px 20px; border: 0px; outline: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 12px; background: rgb(255, 253, 232);">\n	<li style="margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-size: 14px; line-height: 20px; background: transparent;">\n		Interactive Whiteboard or</li>\n	<li style="margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-size: 14px; line-height: 20px; background: transparent;">\n		Interactive Portable System or</li>\n	<li style="margin: 0px 0px 10px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; font-size: 14px; line-height: 20px; background: transparent;">\n		LCD projector &amp; Projector Screen.</li>\n</ul>\n', '', '', ''),
(4, 2, 2, 'Podium Stand', NULL, '<p>\n	Podium Stand</p>\n', '', '', '');
