(5, 1, 1, 'Test English', '<p>\n	<span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Senin, 20/04/2009 16:12 WIB</span></p>\n<h5>\n	<span style="font-size: 14px;"><span style="color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Layanan Terbaik dari Distributor Royal Fingerprint</span></span></h5>\n<h5>\n	<span style="font-size: 14px;"><span style="color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Budi Santoso Talim - suaraPembaca</span></span></h5>\n<p>\n	&nbsp;</p>\n<p>\n	<span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Menindaklanjuti keluhan kami untuk produk Royal Fingerprint type RFP 400 yang telah kami sampaikan pada awal April 2009, maka pada tanggal 16 April 2009 keluhan kami telah mendapatkan respon positif dari pihak PT Offistarindo Adhiprima selaku distributor produk Royal Fingerprint type RFP 400.</span></p>\n<p>\n	<span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Permasalahan ternyata adalah hanya kesalahpahaman biasa saja dan sudah secara bersama-sama diluruskan kembali. Kami sebagai konsumen berterima kasih atas tanggapan dan respon yang cepat. Kami merasa puas dengan pelayanan purna jual dari PT Offistarindo Adhiprima selaku distributor produk Royal Fingerprint type RFP 400. Dalam hal ini PT Offistarindo Adhiprima tidak hanya mau menjual produknya saja. Tetapi, juga turut serta menjalankan kewajibannya dengan menanggapi kesulitan-kesulitan kami sebagai konsumen.</span></p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong><span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Budi Santoso Talim</span></strong></p>\n<p>\n	<strong><span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Jl Asia Baru Blok II No 231 Jakarta</span></strong></p>\n<p>\n	<strong><span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">t4l1m@yahoo.com</span></strong></p>\n<p>\n	<strong><span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">98998684</span></strong></p>\n'),
(6, 1, 2, 'Test Indonesia Subject', '<p>\n	<span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Senin, 20/04/2009 16:12 WIB </span></p>\n<h5>\n	<span style="font-size:14px;"><span style="color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Layanan Terbaik dari Distributor Royal Fingerprint </span></span></h5>\n<h5>\n	<span style="font-size:14px;"><span style="color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Budi Santoso Talim - suaraPembaca</span></span></h5>\n<p>\n	&nbsp;</p>\n<p>\n	<span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Menindaklanjuti keluhan kami untuk produk Royal Fingerprint type RFP 400 yang telah kami sampaikan pada awal April 2009, maka pada tanggal 16 April 2009 keluhan kami telah mendapatkan respon positif dari pihak PT Offistarindo Adhiprima selaku distributor produk Royal Fingerprint type RFP 400. </span></p>\n<p>\n	<span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Permasalahan ternyata adalah hanya kesalahpahaman biasa saja dan sudah secara bersama-sama diluruskan kembali. Kami sebagai konsumen berterima kasih atas tanggapan dan respon yang cepat. Kami merasa puas dengan pelayanan purna jual dari PT Offistarindo Adhiprima selaku distributor produk Royal Fingerprint type RFP 400. Dalam hal ini PT Offistarindo Adhiprima tidak hanya mau menjual produknya saja. Tetapi, juga turut serta menjalankan kewajibannya dengan menanggapi kesulitan-kesulitan kami sebagai konsumen. </span></p>\n<p>\n	&nbsp;</p>\n<p>\n	<strong><span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Budi Santoso Talim </span></strong></p>\n<p>\n	<strong><span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">Jl Asia Baru Blok II No 231 Jakarta </span></strong></p>\n<p>\n	<strong><span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">t4l1m@yahoo.com </span></strong></p>\n<p>\n	<strong><span style="font-size: small; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; line-height: 1.7em;">98998684</span></strong></p>\n'),
